INSERT INTO `problem_drinking_form_answer` (`id`, `problem_drinking_form_question_id`, `answer`, `answer_us`, `value`) VALUES
(1, 1, '<b>Money</b>. I often find that when I go out drinking, I wake up to find that I\'ve spent all of my money.', '<b>Money</b>. I often find that when I go out drinking, I wake up to find that I\'ve spent all of my money.', 0),
(2, 1, '<b>Foggy Memory</b>. I often find that when I wake up in the morning after drinking, I have a foggy memory of the night before.', '<b>Foggy Memory</b>. I often find that when I wake up in the morning after drinking, I have a foggy memory of the night before.', 1),
(3, 1, '<b>Hangovers</b>. I often find that I wake up with a hangover, and my day is ruined.', '<b>Hangovers</b>. I often find that I wake up with a hangover, and my day is ruined.', 2),
(4, 1, '<b>Work</b>. I find that drinking is affecting my performance at work.', '<b>Work</b>. I find that drinking is affecting my performance at work.', 3),
(5, 1, '<b>Can’t Stop</b>. I find that drinking is affecting my performance at work.  I find that once I start drinking, I get on a roll and have a hard time stopping at one or two...', '<b>Can’t Stop</b>. I find that drinking is affecting my performance at work.  I find that once I start drinking, I get on a roll and have a hard time stopping at one or two...', 4),
(6, 1, '<b>Withdrawal Symptoms</b>. When I quit drinking for a few days I experience <a data-toggle=\"modal\" href=\"#withdrawal-symptoms\">withdrawal symptoms</a>.', '<b>Withdrawal Symptoms</b>. When I quit drinking for a few days I experience <a data-toggle=\"modal\" href=\"#withdrawal-symptoms\">withdrawal symptoms</a>.', 5),
(7, 1, '<b>My Social Life</b>. I find that people begin to stray away from me after I\'ve been drinking for a while.', '<b>My Social Life</b>. I find that people begin to stray away from me after I\'ve been drinking for a while.', 6),
(8, 1, '<b>Risky Behavior</b>. I\'ve acted stupid or have taken unnecessary chances while I was drinking.', '<b>Risky Behavior</b>. I\'ve acted stupid or have taken unnecessary chances while I was drinking.', 7),
(9, 1, '<b>My Health</b>. I\'ve noticed that drinking has affected my health (I\'ve fallen down while drinking, had accidents, have been worried about my liver, etc.).', '<b>My Health</b>. I\'ve noticed that drinking has affected my health (I\'ve fallen down while drinking, had accidents, have been worried about my liver, etc.).', 8),
(10, 1, '<b>Guilt</b>. I often have a feeling of guilt or remorse after drinking.', '<b>Guilt</b>. I often have a feeling of guilt or remorse after drinking.', 9),
(11, 4, '<b>Use Self-Talk</b>. Ask yourself \"Do I feel better about myself if I reach my goals?\" or \"If I don’t drink, will anything bad happen?\" or perhaps \"If I do drink, what do I have to gain?\"', '<b>Use Self-Talk</b>. Ask yourself \"Do I feel better about myself if I reach my goals?\" or \"If I don’t drink, will anything bad happen?\" or perhaps \"If I do drink, what do I have to gain?\"', 0),
(12, 4, '<b>Log Back In</b>. Come back to this program on a daily basis and revisit the exercises you\'ve already completed – or do them over again. It\'s anonymous and no one but you will know.', '<b>Log Back In</b>. Come back to this program on a daily basis and revisit the exercises you\'ve already completed – or do them over again. It\'s anonymous and no one but you will know.', 1),
(13, 4, '<b>Use Your Support Team</b>. If you\'re feeling pressure lean on a friend or family member. If it\'s late at night and you need someone to talk to. Log in to our anonymous <a href=\"/community/home\" target=\"_blank\">community</a> and see if there\'s anyone you can talk to or read the posts of others who have experienced the same feelings and frustrations.', '<b>Use Your Support Team</b>. If you\'re feeling pressure lean on a friend or family member. If it\'s late at night and you need someone to talk to. Log in to our anonymous <a href=\"/community/home\" target=\"_blank\">community</a> and see if there\'s anyone you can talk to or read the posts of others who have experienced the same feelings and frustrations.', 2),
(14, 4, '<b>Avoid</b>. For the first few weeks do not hang around people who drink, or drink excessively. Don\'t let your guard down.', '<b>Avoid</b>. For the first few weeks do not hang around people who drink, or drink excessively. Don\'t let your guard down.', 3),
(15, 4, '<b>Practice</b>. Imagine scenarios that you\'ll eventually be placed in and practice saying: \"No thanks\". Visualize both how you\'ll say: \"No thanks\" and imagine how confident you\'ll feel afterwards.', '<b>Practice</b>. Imagine scenarios that you\'ll eventually be placed in and practice saying: \"No thanks\". Visualize both how you\'ll say: \"No thanks\" and imagine how confident you\'ll feel afterwards.', 4),
(16, 4, '<b>Make a Public Pledge</b>. Make a <a href=\"/goals/other\" target=\"_blank\">Public Pledge</a> that supports your goal and frequently remind yourself of the reasons why you’re cutting down or quitting.', '<b>Make a Public Pledge</b>. Make a <a href=\"/goals/other\" target=\"_blank\">Public Pledge</a> that supports your goal and frequently remind yourself of the reasons why you’re cutting down or quitting.', 5),
(17, 4, '<b>Help Others</b>. Log into the community and give some encouragement to others who are just starting out. You might be surprised to realize how much helping others helps you.', '<b>Help Others</b>. Log into the community and give some encouragement to others who are just starting out. You might be surprised to realize how much helping others helps you.', 6),
(18, 4, '<b>Remember Your Triggers</b>. Remind yourself of your <a href=\"/problem-drinking/session?pageId=5&sessionId=38\" target=\"_blank\">trigger situations</a> and avoid them at all costs. Plan your day ahead of time so you can stay away from them.', '<b>Remember Your Triggers</b>. Remind yourself of your <a href=\"/problem-drinking/session?pageId=5&sessionId=38\" target=\"_blank\">trigger situations</a> and avoid them at all costs. Plan your day ahead of time so you can stay away from them.', 7),
(19, 4, '<b>Talk to Your Doctor</b>. Consider a visit with your doctor to see if she or he can recommend any other strategies or medications that might help you get past the first few weeks.', '<b>Talk to Your Doctor</b>. Consider a visit with your doctor to see if she or he can recommend any other strategies or medications that might help you get past the first few weeks.', 8),
(20, 7, 'Get rid of (or give away) any open or closed bottles of alcohol in the home', 'Get rid of (or give away) any open or closed bottles of alcohol in the home', 0),
(21, 7, 'Substitute alcoholic drinks with something non-alcoholic', 'Substitute alcoholic drinks with something non-alcoholic', 1),
(22, 7, 'Stay out of bars and restaurants – at least for a little while', 'Stay out of bars and restaurants – at least for a little while', 2),
(23, 7, 'Avoid heavy drinkers', 'Avoid heavy drinkers', 3),
(24, 7, 'Make a commitment to not buy alcohol – even if it’s a gift for a family member, a celebration or a friend', 'Make a commitment to not buy alcohol – even if it’s a gift for a family member, a celebration or a friend', 4),
(25, 7, 'Start warming up to your <a href=\"/community/home\" target=\"_blank\"> support network</a>', 'Start warming up to your <a href=\"/community/home\" target=\"_blank\"> support network</a>', 5),
(26, 7, 'Even if you plan on not drinking, avoid going \"out for drinks\" with coworkers or after sporting events', 'Even if you plan on not drinking, avoid going \"out for drinks\" with coworkers or after sporting events', 6),
(27, 7, 'Throw away or get rid of everything in your home that reminds you of drinking: beer bottle openers, highball glasses, corkscrews etc.', 'Throw away or get rid of everything in your home that reminds you of drinking: beer bottle openers, highball glasses, corkscrews etc.', 7),
(28, 7, 'Make a list of people or places that you should avoid', 'Make a list of people or places that you should avoid', 8),
(29, 7, 'Practice saying <a href=/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a>', 'Practice saying <a href=/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a>', 9),
(30, 7, 'Remind yourself of your <a href=\"/goals/other\" target=\"_blank\">public pledge</a>', 'Remind yourself of your <a href=\"/goals/other\" target=\"_blank\">public pledge</a>', 10),
(31, 38, 'Having a great time with others who are drinking and wanting to share the experience', 'Having a great time with others who are drinking and wanting to share the experience', 0),
(32, 38, 'Missing the feeling of being drunk or \"high\"', 'Missing the feeling of being drunk or \"high\"', 1),
(33, 38, 'Having withdrawal symptoms (physical pain from not drinking)', 'Having withdrawal symptoms (physical pain from not drinking)', 2),
(34, 38, 'Seeing alcohol on grocery or corner store shelves or in the freezer', 'Seeing alcohol on grocery or corner store shelves or in the freezer', 3),
(35, 38, 'Walking past a bar or restaurant where I used to drink', 'Walking past a bar or restaurant where I used to drink', 4),
(36, 38, 'Stressful situations', 'Stressful situations', 5),
(37, 38, 'Feeling like \"I can have just one drink\" or \"just one more drink\"', 'Feeling like \"I can have just one drink\" or \"just one more drink\"', 6),
(38, 38, 'Experiencing a strong craving to drink', 'Experiencing a strong craving to drink', 7),
(39, 38, 'A specific time of the day when you used to pour yourself a drink', 'A specific time of the day when you used to pour yourself a drink', 8),
(40, 38, 'Testing your limits or seeing how much you can handle without appearing intoxicated', 'Testing your limits or seeing how much you can handle without appearing intoxicated', 9),
(41, 38, 'Being around family members who drink', 'Being around family members who drink', 10),
(42, 38, 'Feeling great, and wanting a drink because it\'ll make me feel even better or more social', 'Feeling great, and wanting a drink because it\'ll make me feel even better or more social', 11),
(43, 38, 'Hanging out with friends I used to drink with', 'Hanging out with friends I used to drink with', 12),
(44, 38, 'Weekends', 'Weekends', 13),
(45, 38, 'Being bored or having nothing to do', 'Being bored or having nothing to do', 14),
(46, 38, 'Watching sports', 'Watching sports', 15),
(47, 38, 'Feeling stressed out', 'Feeling stressed out', 16),
(48, 38, 'Someone offering you a drink and having a hard time saying <a href=\"/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a>', 'Someone offering you a drink and having a hard time saying <a href=\"/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a>', 17),
(49, 58, '<b>Have a drink spacer: </b>Have a full glass of water after every drink.', '<b>Have a drink spacer: </b>Have a full glass of water after every drink.', 0),
(50, 58, '<b>Set a strict budget: </b>If you go out to a bar, only bring a set amount of money with you (remember cab fare). Leave your bank card and credit cards at home.', '<b>Set a strict budget: </b>If you go out to a bar, only bring a set amount of money with you (remember cab fare). Leave your bank card and credit cards at home.', 1),
(51, 58, '<b>Eat something: </b>Eat something before you start drinking and have some snacks.', '<b>Eat something: </b>Eat something before you start drinking and have some snacks.', 2),
(52, 58, '<b>Find a buddy: </b>If you find that you\'re having a tough time cutting the evening short, call a buddy or friend. Let them know that you might be calling.', '<b>Find a buddy: </b>If you find that you\'re having a tough time cutting the evening short, call a buddy or friend. Let them know that you might be calling.', 3),
(53, 58, '<b>Set limits at events: </b>Decide, before an event, how many drinks that you\'re going to allow yourself to have. Don\'t go over your limit.', '<b>Set limits at events: </b>Decide, before an event, how many drinks that you\'re going to allow yourself to have. Don\'t go over your limit.', 4),
(54, 58, '<b>Use substitutes: </b>Have a glass of mineral or soda water after every drink. This will slow you down, help you with hydration, and cause you to drink less.', '<b>Use substitutes: </b>Have a glass of mineral or soda water after every drink. This will slow you down, help you with hydration, and cause you to drink less.', 5),
(55, 58, '<b>Pick a time to go home: </b>Before you leave the house, set your watch alarm or pick a time that you\'re going to stop drinking and head home.', '<b>Pick a time to go home: </b>Before you leave the house, set your watch alarm or pick a time that you\'re going to stop drinking and head home.', 6),
(56, 58, '<b>People: </b>There may be some heavy drinkers that influence how much you drink. Resolve not to hang around them while they\'re drinking.', '<b>People: </b>There may be some heavy drinkers that influence how much you drink. Resolve not to hang around them while they\'re drinking.', 7),
(57, 58, '<b>Drink slowly: </b>Savor and enjoy the taste of an alcoholic drink by taking small sips instead of drinking quickly.', '<b>Drink slowly: </b>Savor and enjoy the taste of an alcoholic drink by taking small sips instead of drinking quickly.', 8),
(58, 58, '<b>Places:</b> There may be some bars, friend\'s houses or other locations (tailgate parties, cottages or summer houses) where you often find yourself drinking too much. Decide to stay away from these places.', '<b>Places:</b> There may be some bars, friend\'s houses or other locations (tailgate parties, cottages or summer houses) where you often find yourself drinking too much. Decide to stay away from these places.', 9),
(59, 58, '<b>Set a weekly limit: </b>Set a limit on the total number of drinks you\'ll have per week and do not go past your limit. Use your diary to track the number (and type) of drinks you have every week.', '<b>Set a weekly limit: </b>Set a limit on the total number of drinks you\'ll have per week and do not go past your limit. Use your diary to track the number (and type) of drinks you have every week.', 10),
(60, 58, '<b>Set a daily limit:</b> Set a limit on the total number of drinks you\'ll have per day and do not go past your limit. Use your <a href=\"/problem-drinking/#progress-tracker\" target=\"_blank\">diary</a> to track the number (and type) of drinks you have per day.', '<b>Set a daily limit:</b> Set a limit on the total number of drinks you\'ll have per day and do not go past your limit. Use your <a href=\"/problem-drinking/#progress-tracker\" target=\"_blank\">diary</a> to track the number (and type) of drinks you have per day.', 11),
(61, 58, '<b>Use your diary:</b> If you\'ve had a few drinks, use the Notes and Observations section to record who you were with, where you were and how you felt. Make a pledge to review your notes before you drink again.', '<b>Use your diary:</b> If you\'ve had a few drinks, use the Notes and Observations section to record who you were with, where you were and how you felt. Make a pledge to review your notes before you drink again.', 12),
(62, 67, 'Drink non-alcoholic beverages (e.g., water, soda, pop, juice, coffee, tea).', 'Drink non-alcoholic beverages (e.g., water, soda, pop, juice, coffee, tea).', 0),
(63, 67, 'Eat some food or distract yourself with some snacks.', 'Eat some food or distract yourself with some snacks.', 1),
(64, 67, 'Engage in other activities (e.g. walk, sports, hobby, go to the gym, clean the house).', 'Engage in other activities (e.g. walk, sports, hobby, go to the gym, clean the house).', 2),
(65, 67, 'Get in touch with friends or family who will help you get over the urge.', 'Get in touch with friends or family who will help you get over the urge.', 3),
(66, 67, 'Think about how much money you’ll save by not drinking (make sure you use the money you save to buy something nice for yourself).', 'Think about how much money you’ll save by not drinking (make sure you use the money you save to buy something nice for yourself).', 4),
(67, 67, 'Try to distract yourself from thinking about your desire to drink.', 'Try to distract yourself from thinking about your desire to drink.', 5),
(68, 67, 'Think about your Costs and Benefits exercise and focus on your benefits.', 'Think about your Costs and Benefits exercise and focus on your benefits.', 6),
(69, 67, 'Give yourself 15 minutes. Reassure yourself that the thoughts and desires will go away on their own.', 'Give yourself 15 minutes. Reassure yourself that the thoughts and desires will go away on their own.', 7),
(70, 67, 'Leave the place or situation when you get the urge', 'Leave the place or situation when you get the urge', 8),
(71, 67, 'Try to identify what’s causing your desire to have drink.', 'Try to identify what’s causing your desire to have drink.', 9),
(72, 67, 'Review what you’ve learned from this program.', 'Review what you’ve learned from this program.', 10),
(73, 70, 'Visualize: stand in front of a mirror and imagine someone offering you a drink. Smile, pause and simply say \"No thanks\".', 'Visualize: stand in front of a mirror and imagine someone offering you a drink. Smile, pause and simply say \"No thanks\".', 0),
(74, 70, 'Remind Yourself: Saying \"No thanks\" isn’t a sign of a weak person. Quite the contrary; it takes a strong person to quit or cut down.', 'Remind Yourself: Saying \"No thanks\" isn’t a sign of a weak person. Quite the contrary; it takes a strong person to quit or cut down.', 1),
(75, 70, 'Alternatives: After saying “No thanks” suggest an alternative such as: \"I\'m going to grab something to eat\", or: \"I think I\'m going to have a soda\".', 'Alternatives: After saying “No thanks” suggest an alternative such as: \"I\'m going to grab something to eat\", or: \"I think I\'m going to have a soda\".', 2),
(76, 70, 'Leave: If you find yourself in a trigger situation, or if someone is pestering you, say \"No thanks\" and leave the situation. You\'ll feel better about it in the morning.', 'Leave: If you find yourself in a trigger situation, or if someone is pestering you, say \"No thanks\" and leave the situation. You\'ll feel better about it in the morning.', 3),
(77, 70, 'Change the Subject: If you\'re offered a drink say: \"No thanks\" and then talk about the weather, sports, the news, vacation spots or any number of subjects that the person offering you a drink may be interested in.', 'Change the Subject: If you\'re offered a drink say: \"No thanks\" and then talk about the weather, sports, the news, vacation spots or any number of subjects that the person offering you a drink may be interested in.', 4),
(78, 70, 'Focus on Your Goal: Pause for a moment, think about your goal before saying \"No thanks\".', 'Focus on Your Goal: Pause for a moment, think about your goal before saying \"No thanks\".', 5),
(79, 70, 'Consequences: Focus on the consequences of saying \"Sure\" instead of \"No thanks\".', 'Consequences: Focus on the consequences of saying \"Sure\" instead of \"No thanks\".', 6),
(80, 70, 'Delay: Say \"No thanks, I think I\'m going to wait for 10 or 15 minutes\". Then, think of your <a href=\"/problem-drinking/session?pageId=15&sessionId=39\" target=\"_blank\">coping plan</a>.', 'Delay: Say \"No thanks, I think I\'m going to wait for 10 or 15 minutes\". Then, think of your <a href=\"/problem-drinking/session?pageId=15&sessionId=39\" target=\"_blank\">coping plan</a>.', 7),
(81, 94, 'Spend an hour playing with the kids', 'Spend an hour playing with the kids', 0),
(82, 94, 'Get off the bus a few blocks from work and walk the rest of the way', 'Get off the bus a few blocks from work and walk the rest of the way', 1),
(83, 94, 'Walk the dog after dinner', 'Walk the dog after dinner', 2),
(84, 94, 'Get active – join a walking club or recreational sports league', 'Get active – join a walking club or recreational sports league', 3),
(85, 94, 'Take up gardening in your back yard or on your balcony', 'Take up gardening in your back yard or on your balcony', 4),
(86, 94, 'Spend your coffee break outside in the fresh air (away from the smokers!)', 'Spend your coffee break outside in the fresh air (away from the smokers!)', 5),
(87, 94, 'Ride your bike to the store', 'Ride your bike to the store', 6),
(88, 94, 'Catch up on all those household projects you\'ve been putting off', 'Catch up on all those household projects you\'ve been putting off', 7),
(89, 94, 'Walk to the park on your lunch hour', 'Walk to the park on your lunch hour', 8),
(90, 94, 'Do some gentle stretches in the morning', 'Do some gentle stretches in the morning', 9),
(91, 94, 'At work, take the stairs instead of the elevator', 'At work, take the stairs instead of the elevator', 10),
(92, 97, 'Keep a tall glass of cool water nearby and take long, slow sips', 'Keep a tall glass of cool water nearby and take long, slow sips', 0),
(93, 97, 'Snack on fresh vegetables like celery and carrots sticks', 'Snack on fresh vegetables like celery and carrots sticks', 1),
(94, 97, 'When eating meals, pause between mouthfuls', 'When eating meals, pause between mouthfuls', 2),
(95, 97, 'Replace every other cup of coffee with tea', 'Replace every other cup of coffee with tea', 3),
(96, 97, 'Snack on unbuttered popcorn', 'Snack on unbuttered popcorn', 4),
(97, 97, 'Enjoy sugar-free candies', 'Enjoy sugar-free candies', 5),
(98, 97, 'Slowly eat thin slices of your favourite fruits', 'Slowly eat thin slices of your favourite fruits', 6),
(99, 97, 'Keep lots of low calorie, non-alcoholic, decaffeinated drinks on hand', 'Keep lots of low calorie, non-alcoholic, decaffeinated drinks on hand', 7),
(100, 97, 'Chew sugar-free gum', 'Chew sugar-free gum', 8),
(101, 100, 'Deep breathing exercises ', 'Deep breathing exercises ', 0),
(102, 100, 'Tension releasing exercises', 'Tension releasing exercises', 1),
(103, 100, 'Listening to soft music', 'Listening to soft music', 2),
(104, 100, 'Squeezing a tennis or stress ball', 'Squeezing a tennis or stress ball', 3),
(105, 100, 'Meditate and then have a short nap', 'Meditate and then have a short nap', 4),
(106, 100, 'Having a long hot bath or shower', 'Having a long hot bath or shower', 5),
(107, 100, 'Going for a brisk walk', 'Going for a brisk walk', 6),
(108, 100, 'Reading a good book', 'Reading a good book', 7),
(109, 100, 'Doing a hobby like knitting or puzzles', 'Doing a hobby like knitting or puzzles', 8),
(110, 100, 'Talk about your stress with your partner or close friend', 'Talk about your stress with your partner or close friend', 9);
INSERT INTO `problem_drinking_form_question` (`id`, `type`, `problem_drinking_page_id`, `text`, `text_us`, `text_before_question`, `text_before_question_us`, `text_after_question`, `text_after_question_us`, `field_name`, `has_replace_text`, `hide_question`) VALUES
(1, 6, 1, 'Check the statements that may sound familiar to you:', 'Check the statements that may sound familiar to you:', '<p>You might feel like there&#39;s no reason why you shouldn&#39;t enjoy a drink or two. After all, a lot of people drink alcohol and drinking with others can be cultural. There are a lot of places and events where people get together and have a few drinks: weddings, wakes, sporting events, celebrations, graduations, family dinners &ndash; just to name a few.</p>\r\n\r\n<p>Then again, a lot of people just don&#39;t drink. They might not like the taste, how alcohol makes them feel, or they may have had a bad experience in the past.</p>\r\n\r\n<p>But you&#39;re here because you&#39;re asking the question: &quot;Do I drink too much?&quot;</p>\r\n\r\n<p><b>Answer:</b> you&#39;re the only person who can decide if you want to moderate your drinking, cut down, or quit drinking completely. But we can help you with your decision &ndash; and we&#39;re also aware that decisions (or <a href=\"/goals/other\" target=\"_blank\">goals</a>) can change.</p>\r\n\r\n<p>This program is not just about quitting drinking entirely. Some of the exercises in the program are designed to help those who are quitting (or <a data-toggle=\"modal\" href=\"#abstaining\">abstaining</a>) POPAP alcohol. But, some these exercises are also designed for people who want to cut down. We support everyone.</p>\r\n\r\n<p>To get started, you might want to try some of the interactive exercises like the <a href=\"/problem-drinking/cyd\" target=\"_blank\">Check Your Drinking</a>. In this program, you can pick whatever exercise you like. Also, feel free to redo exercises.</p>\r\n\r\n<p>You may be still asking the question: &quot;Do I Drink Too Much?&quot; This short exercise can get you thinking&hellip;</p>\r\n\r\n<h4 class=\"eh_subtitle h4_subtitle\">Do I Drink Too Much?</h4>\r\n\r\n<p>Here are just a few of the issues that people encounter when they feel they might drink too much.</p>\r\n', '<p>You might feel like there&#39;s no reason why you shouldn&#39;t enjoy a drink or two. After all, a lot of people drink alcohol and drinking with others can be cultural. There are a lot of places and events where people get together and have a few drinks: weddings, wakes, sporting events, celebrations, graduations, family dinners &ndash; just to name a few.</p>\r\n\r\n<p>Then again, a lot of people just don&#39;t drink. They might not like the taste, how alcohol makes them feel, or they may have had a bad experience in the past.</p>\r\n\r\n<p>But you&#39;re here because you&#39;re asking the question: &quot;Do I drink too much?&quot;</p>\r\n\r\n<p><b>Answer:</b> you&#39;re the only person who can decide if you want to moderate your drinking, cut down, or quit drinking completely. But we can help you with your decision &ndash; and we&#39;re also aware that decisions (or <a href=\"/goals/other\" target=\"_blank\">goals</a>) can change.</p>\r\n\r\n<p>This program is not just about quitting drinking entirely. Some of the exercises in the program are designed to help those who are quitting (or <a data-toggle=\"modal\" href=\"#abstaining\">abstaining</a>) POPAP alcohol. But, some these exercises are also designed for people who want to cut down. We support everyone.</p>\r\n\r\n<p>To get started, you might want to try some of the interactive exercises like the <a href=\"/problem-drinking/cyd\" target=\"_blank\">Check Your Drinking</a>. In this program, you can pick whatever exercise you like. Also, feel free to redo exercises.</p>\r\n\r\n<p>You may be still asking the question: &quot;Do I Drink Too Much?&quot; This short exercise can get you thinking&hellip;</p>\r\n\r\n<h4 class=\"eh_subtitle h4_subtitle\">Do I Drink Too Much?</h4>\r\n\r\n<p>Here are just a few of the issues that people encounter when they feel they might drink too much.</p>\r\n', NULL, NULL, 'p1_q1', 0, 0),
(2, 2, 1, 'You may have other, more personal, reasons for feeling like you drink too much. Feel free to write them in the below spaces:', 'You may have other, more personal, reasons for feeling like you drink too much. Feel free to write them in the below spaces:', NULL, NULL, NULL, NULL, 'p1_q2', 0, 0),
(3, 2, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'p1_q3', 0, 1),
(4, 6, 2, 'When things get tough, what strategies can work for you?', 'When things get tough, what strategies can work for you?', '\r\n                 <p>Whether your <a href=\"/goals/other\" target=\"_blank\">goal</a> is to cut down, or quit drinking entirely, the\r\n                        first\r\n                        few weeks can be the toughest. The good news is that there are strategies that can make these\r\n                        first few weeks <a href=\"/problem-drinking/session?pageId=20&sessionId=40\" target=\"_blank\">less stressful</a>.</p>\r\n                    <p>There are strategies that work. We know they work because researchers who specialize in the field\r\n                        of alcohol reduction have studied these strategies for years. If possible, complete this\r\n                        exercise before, or during, the first two weeks.\r\n                    </p>\r\n                ', '\r\n                 <p>Whether your <a href=\"/goals/other\" target=\"_blank\">goal</a> is to cut down, or quit drinking entirely, the\r\n                        first\r\n                        few weeks can be the toughest. The good news is that there are strategies that can make these\r\n                        first few weeks <a href=\"/problem-drinking/session?pageId=20&sessionId=40\" target=\"_blank\">less stressful</a>.</p>\r\n                    <p>There are strategies that work. We know they work because researchers who specialize in the field\r\n                        of alcohol reduction have studied these strategies for years. If possible, complete this\r\n                        exercise before, or during, the first two weeks.\r\n                    </p>\r\n                ', NULL, NULL, 'p2_q1', 0, 0),
(5, 2, 2, 'In order to help reach your goal, what two strategies can you use to help you get through the rough spots?', 'In order to help reach your goal, what two strategies can you use to help you get through the rough spots?', NULL, NULL, NULL, NULL, 'p2_q2', 0, 0),
(6, 2, 2, NULL, NULL, NULL, NULL, NULL, NULL, 'p2_q3', 0, 1),
(7, 6, 3, 'Here\'s a list of some things you could do to before you cut back. Which ones would work for you?', 'Here\'s a list of some things you could do to before you cut back. Which ones would work for you?', ' <p>Slow and steady often wins the race, so if your goal (or your first goal – goals can change) is\r\n                        to cut back it might be a good idea to sit back and think about ways that you can cut back.</p>\r\n                    <p>Cutting back can also be helpful when planning on quitting drinking entirely. Quitting \"cold\r\n                        turkey\" can be tough for some people – the below suggestions can really help out.</p>\r\n', ' <p>Slow and steady often wins the race, so if your goal (or your first goal – goals can change) is\r\n                        to cut back it might be a good idea to sit back and think about ways that you can cut back.</p>\r\n                    <p>Cutting back can also be helpful when planning on quitting drinking entirely. Quitting \"cold\r\n                        turkey\" can be tough for some people – the below suggestions can really help out.</p>\r\n', NULL, NULL, 'p3_q1', 0, 0),
(8, 2, 3, 'It takes a bit of planning but cutting back does take some time. Since everyone is different, what are \r\n                two personal activities you can do to start cutting back?', 'It takes a bit of planning but cutting back does take some time. Since everyone is different, what are \r\n                two personal activities you can do to start cutting back?', NULL, NULL, NULL, NULL, 'p3_q2', 0, 0),
(9, 2, 3, NULL, NULL, NULL, NULL, NULL, NULL, 'p3_q3', 0, 1),
(10, 10, 4, 'I\'ll feel better physically', 'I\'ll feel better physically', ' \r\n                \r\n                 <p>Making the decision to change, or not change, how much you drink is often difficult. This\r\n                        exercise shows some of the possible costs or benefits to changing how much you drink. </p>\r\n                    <p>This exercise takes some thought, and some costs and benefits change, so feel free to come back\r\n                        and redo this exercise another time:</p> <p></p>', ' \r\n                \r\n                 <p>Making the decision to change, or not change, how much you drink is often difficult. This\r\n                        exercise shows some of the possible costs or benefits to changing how much you drink. </p>\r\n                    <p>This exercise takes some thought, and some costs and benefits change, so feel free to come back\r\n                        and redo this exercise another time:</p> <p></p>', NULL, NULL, 'costs_and_benefits', 0, 0),
