(38, 6, 5, 'Here\'s a list of some common triggers. Which ones might apply to you?', 'Here\'s a list of some common triggers. Which ones might apply to you?', '  <p>What are triggers? Quite simply, triggers are situations, times of the day, activities, emotions\r\n                        or even people that tempt you to drink or remind you of drinking. </p>\r\n                    <p>Sometimes you can predict a trigger. If you used to have a drink every night before bed, you can\r\n                        bet that your body will remember, and you\'ll get an urge to drink before you hit the sack. In\r\n                        that situation, a certain time of day is a \"trigger\". Before you refrain yourself to not drink\r\n                        before bed, you can expect to continually experience strong triggers around bedtime.</p>\r\n                    <p>You can also experience a trigger accidentally, or \"out of the blue\". For example, if you bump\r\n                        into a friend that you used to drink with, you might experience a strong desire to drink (even\r\n                        if you don\'t plan too).</p>\r\n                    <p>Everyone has different triggers. And before you learn how to deal with them you need to recognize\r\n                        what they are.</p>', '  <p>What are triggers? Quite simply, triggers are situations, times of the day, activities, emotions\r\n                        or even people that tempt you to drink or remind you of drinking. </p>\r\n                    <p>Sometimes you can predict a trigger. If you used to have a drink every night before bed, you can\r\n                        bet that your body will remember, and you\'ll get an urge to drink before you hit the sack. In\r\n                        that situation, a certain time of day is a \"trigger\". Before you refrain yourself to not drink\r\n                        before bed, you can expect to continually experience strong triggers around bedtime.</p>\r\n                    <p>You can also experience a trigger accidentally, or \"out of the blue\". For example, if you bump\r\n                        into a friend that you used to drink with, you might experience a strong desire to drink (even\r\n                        if you don\'t plan too).</p>\r\n                    <p>Everyone has different triggers. And before you learn how to deal with them you need to recognize\r\n                        what they are.</p>', NULL, NULL, 'p5_q1', 0, 0),
(39, 2, 5, 'It helps to identify them before they happen, and everyone’s triggers are different. What are two personal triggers? ', 'It helps to identify them before they happen, and everyone’s triggers are different. What are two personal triggers? ', NULL, NULL, NULL, NULL, 'p5_q2', 0, 0),
(40, 2, 5, NULL, NULL, NULL, NULL, NULL, NULL, 'p5_q3', 0, 1),
(41, 10, 6, 'Stressful situations', 'Stressful situations', '\r\n                 <p>High risk situations are situations that you may find yourself in and may give you a strong urge\r\n                        or desire to drink. You may find that you can\'t avoid these situations, or, they can happen\r\n                        unexpectedly.\r\n                        As you move toward your <a href=\'/goals/other\' target=\'_blank\'>goal</a> you\'ll need to become familiar with your\r\n                        personal high-risk situations. Think about your drinking over the past year, and for each of the\r\n                        following situations rate the following statements.\r\n                    </p>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">Rating System</h4>\r\n                    <p>Think carefully about the following situations that you might have been in. If you had a few\r\n                        drinks in that situation rate it as \"5\". If you didn\'t drink at all, rate it as \"0\". If you\r\n                        drank heavily rate it as \"10\". Think carefully and freely use all points of the scale to assess\r\n                        how you drank in each situation:</p>', '\r\n                 <p>High risk situations are situations that you may find yourself in and may give you a strong urge\r\n                        or desire to drink. You may find that you can\'t avoid these situations, or, they can happen\r\n                        unexpectedly.\r\n                        As you move toward your <a href=\'/goals/other\' target=\'_blank\'>goal</a> you\'ll need to become familiar with your\r\n                        personal high-risk situations. Think about your drinking over the past year, and for each of the\r\n                        following situations rate the following statements.\r\n                    </p>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">Rating System</h4>\r\n                    <p>Think carefully about the following situations that you might have been in. If you had a few\r\n                        drinks in that situation rate it as \"5\". If you didn\'t drink at all, rate it as \"0\". If you\r\n                        drank heavily rate it as \"10\". Think carefully and freely use all points of the scale to assess\r\n                        how you drank in each situation:</p>', NULL, NULL, 'high_risk_situation', 0, 0),
