(53, 10, 6, 'A certain time of the day (lunchtime, a drink before bed, a drink in the morning to “get you going”)', 'A certain time of the day (lunchtime, a drink before bed, a drink in the morning to “get you going”)', NULL, NULL, NULL, NULL, 'high_risk_situation', 0, 0),
