(57, 2, 6, NULL, NULL, NULL, NULL, NULL, NULL, 'p6_q3', 0, 1),
(58, 6, 7, 'Here are some common \"rules\" that have worked for people who were trying to cut down or quit\r\n                        drinking. Put a check mark beside the ones that might work for you. There\'s some space at the\r\n                        bottom of this exercise where you can record some personal rules that might work for you.', 'Here are some common \"rules\" that have worked for people who were trying to cut down or quit\r\n                        drinking. Put a check mark beside the ones that might work for you. There\'s some space at the\r\n                        bottom of this exercise where you can record some personal rules that might work for you.', ' <p>One thing that is certain is that you\'re in charge of the way you drink. As you work toward\r\n                        reaching your <a href=\"/goals/other\" target=\"_blank\">goal</a> sit back and think about making some rules that\r\n                        you\'ll follow. When you\'re finished this exercise, you might want to print it out and carry it\r\n                        with you so you can remind yourself of your new rules if needed.\r\n                    </p>\r\n                    <p>Set some rules and try to stick with them for a few weeks. It\'s OK to change the rules but try\r\n                        not to change them too often and give yourself some time to get used to them.</p>\r\n                    ', ' <p>One thing that is certain is that you\'re in charge of the way you drink. As you work toward\r\n                        reaching your <a href=\"/goals/other\" target=\"_blank\">goal</a> sit back and think about making some rules that\r\n                        you\'ll follow. When you\'re finished this exercise, you might want to print it out and carry it\r\n                        with you so you can remind yourself of your new rules if needed.\r\n                    </p>\r\n                    <p>Set some rules and try to stick with them for a few weeks. It\'s OK to change the rules but try\r\n                        not to change them too often and give yourself some time to get used to them.</p>\r\n                    ', NULL, NULL, 'p7_q1', 0, 0),
(59, 2, 7, 'You might have other, more personal ideas that may help you set some new “rules” around your drinking. ', 'You might have other, more personal ideas that may help you set some new “rules” around your drinking. ', NULL, NULL, NULL, NULL, 'p7_q2', 0, 0),
(60, 2, 7, NULL, NULL, NULL, NULL, NULL, NULL, 'p7_q3', 0, 1),
(61, 2, 8, 'What are two things that you could do to reward yourself on a daily basis?', 'What are two things that you could do to reward yourself on a daily basis?', '  <p>Whether it’s quitting drinking or cutting down, reaching your goal is a huge accomplishment and\r\n                        you need to reward yourself along the way. Rewarding yourself is extremely important – and you\r\n                        must take time out to congratulate yourself. It’s not easy to reach a goal.\r\n                    </p>\r\n                    <p>We encourage you to think ahead and plan how you’ll reward yourself over the coming months.\r\n                        Reward yourself by buying things that you like, by spending time with certain people, or by\r\n                        going places.</p>\r\n                    <p>Here are some common \"rules\" that have worked for people who were trying to cut down or quit\r\n                        drinking. Put a check mark beside the ones that might work for you. There\'s some space at the\r\n                        bottom of this exercise where you can record some personal rules that might work for you.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">1. My daily rewards – 15 to 30 minutes per day. </h4>\r\n                    <p>Set aside at least 15 to 30 minutes each day to do something special for yourself. It’s important\r\n                        that you take the time to do this – you’ve worked very hard and these 15 to 30 minutes will\r\n                        allow you to sit back, recognize and reaffirm your commitment.</p>\r\n                    <p>Many people find it easier to reward themselves at the same time each day. Daily rewards might\r\n                        include:</p>\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>A hot bath and a great book</li>\r\n                        <li>A bike ride with the kids</li>\r\n                        <li>Picking up some fresh fruit</li>\r\n                        <li>15 minutes of personal time </li>\r\n                        <li>Buying something new</li>\r\n                        <li>Eating your favorite (healthy) snack food</li>\r\n                        <li>Watching a favorite television show</li>\r\n                        <li>Listening to yourself breathe, feeling strong and healthy</li>\r\n                    </ul> <p>What are two things that you could do to reward yourself on a daily basis?</p>', '  <p>Whether it’s quitting drinking or cutting down, reaching your goal is a huge accomplishment and\r\n                        you need to reward yourself along the way. Rewarding yourself is extremely important – and you\r\n                        must take time out to congratulate yourself. It’s not easy to reach a goal.\r\n                    </p>\r\n                    <p>We encourage you to think ahead and plan how you’ll reward yourself over the coming months.\r\n                        Reward yourself by buying things that you like, by spending time with certain people, or by\r\n                        going places.</p>\r\n                    <p>Here are some common \"rules\" that have worked for people who were trying to cut down or quit\r\n                        drinking. Put a check mark beside the ones that might work for you. There\'s some space at the\r\n                        bottom of this exercise where you can record some personal rules that might work for you.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">1. My daily rewards – 15 to 30 minutes per day. </h4>\r\n                    <p>Set aside at least 15 to 30 minutes each day to do something special for yourself. It’s important\r\n                        that you take the time to do this – you’ve worked very hard and these 15 to 30 minutes will\r\n                        allow you to sit back, recognize and reaffirm your commitment.</p>\r\n                    <p>Many people find it easier to reward themselves at the same time each day. Daily rewards might\r\n                        include:</p>\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>A hot bath and a great book</li>\r\n                        <li>A bike ride with the kids</li>\r\n                        <li>Picking up some fresh fruit</li>\r\n                        <li>15 minutes of personal time </li>\r\n                        <li>Buying something new</li>\r\n                        <li>Eating your favorite (healthy) snack food</li>\r\n                        <li>Watching a favorite television show</li>\r\n                        <li>Listening to yourself breathe, feeling strong and healthy</li>\r\n                    </ul> <p>What are two things that you could do to reward yourself on a daily basis?</p>', NULL, NULL, 'p8_q1', 0, 1),
(62, 2, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'p8_q2', 0, 1),
(63, 2, 8, 'What are two activities that you could do to reward yourself on a weekly basis?', 'What are two activities that you could do to reward yourself on a weekly basis?', '    <h4 class=\"eh_subtitle h4_subtitle\">2. My weekly rewards – one to four-hour reward per week.</h4>\r\n                    <p>In addition to your daily rewards, set aside at least 1 to 4 hours every week to reward yourself\r\n                        for your most recent seven day stretch of meeting your goal. Weekly rewards might include:</p>\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>A hike with the kids</li>\r\n                        <li>Seeing a special movie</li>\r\n                        <li>Getting a manicure or hair done</li>\r\n                        <li>Going out for dinner</li>\r\n                        <li>Investing time in a hobby</li>\r\n                        <li>A long walk with a friend</li>\r\n                    </ul> \r\n                    <p>What are two activities that you could do to reward yourself on a weekly basis?</p>', '    <h4 class=\"eh_subtitle h4_subtitle\">2. My weekly rewards – one to four-hour reward per week.</h4>\r\n                    <p>In addition to your daily rewards, set aside at least 1 to 4 hours every week to reward yourself\r\n                        for your most recent seven day stretch of meeting your goal. Weekly rewards might include:</p>\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>A hike with the kids</li>\r\n                        <li>Seeing a special movie</li>\r\n                        <li>Getting a manicure or hair done</li>\r\n                        <li>Going out for dinner</li>\r\n                        <li>Investing time in a hobby</li>\r\n                        <li>A long walk with a friend</li>\r\n                    </ul> \r\n                    <p>What are two activities that you could do to reward yourself on a weekly basis?</p>', NULL, NULL, 'p8_q3', 0, 1),
(64, 2, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'p8_q4', 0, 1),
(65, 2, 8, 'What could you do when you reach your goal for an entire month?  ', 'What could you do when you reach your goal for an entire month?  ', ' <h4 class=\"eh_subtitle h4_subtitle\">3. My first month – half-day or full day reward.</h4>\r\n\r\n                    <p>Your first month of meeting your goal is a tremendous personal accomplishment and an important\r\n                        milestone. You should plan something very special after your first month. Let your imagination\r\n                        run wild – you deserve it! Some suggestions:</p>\r\n\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>Spa day: A massage or facial</li>\r\n                        <li>Shopping for new clothes</li>\r\n                        <li>A game of golf with friends</li>\r\n                        <li>A family trip out of town</li>\r\n                        <li>A day of skiing or canoeing</li>\r\n                        <li>Go to a special sporting event</li>\r\n                    </ul> <p>What could you do when you reach your goal for an entire month?</p>', ' <h4 class=\"eh_subtitle h4_subtitle\">3. My first month – half-day or full day reward.</h4>\r\n\r\n                    <p>Your first month of meeting your goal is a tremendous personal accomplishment and an important\r\n                        milestone. You should plan something very special after your first month. Let your imagination\r\n                        run wild – you deserve it! Some suggestions:</p>\r\n\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>Spa day: A massage or facial</li>\r\n                        <li>Shopping for new clothes</li>\r\n                        <li>A game of golf with friends</li>\r\n                        <li>A family trip out of town</li>\r\n                        <li>A day of skiing or canoeing</li>\r\n                        <li>Go to a special sporting event</li>\r\n                    </ul> <p>What could you do when you reach your goal for an entire month?</p>', NULL, NULL, 'p8_q5', 0, 111),
(66, 2, 8, 'After six months of meeting your goal, reward yourself by spending the money you save on:', 'After six months of meeting your goal, reward yourself by spending the money you save on:', '<h4 class=\"eh_subtitle h4_subtitle\">4. My first six months – huge reward time!</h4>\r\n                    <p>It doesn’t matter if your goal is to quit drinking entirely or to reduce your drinking, you need\r\n                        to reward yourself for meeting your goal.</p>\r\n                    <p>Every week we encourage you to take your savings and tuck them away in a special place (you’d be\r\n                        spending the money anyway – so now watch it grow!). You can reward yourself at your six-month\r\n                        milestone by...</p>\r\n\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>Taking a well-deserved vacation</li>\r\n                        <li>Buying a new bike</li>\r\n                        <li>Updating your wardrobe</li>\r\n                        <li>Having your car professionally cleaned</li>\r\n                        <li>Investing your money</li>\r\n                        <li>Paying off a debt</li>\r\n                    </ul> \r\n                    <p class=\"question-text-pr-dr\">After six months of meeting your goal, reward yourself by spending the money you save on:</p>', '<h4 class=\"eh_subtitle h4_subtitle\">4. My first six months – huge reward time!</h4>\r\n                    <p>It doesn’t matter if your goal is to quit drinking entirely or to reduce your drinking, you need\r\n                        to reward yourself for meeting your goal.</p>\r\n                    <p>Every week we encourage you to take your savings and tuck them away in a special place (you’d be\r\n                        spending the money anyway – so now watch it grow!). You can reward yourself at your six-month\r\n                        milestone by...</p>\r\n\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>Taking a well-deserved vacation</li>\r\n                        <li>Buying a new bike</li>\r\n                        <li>Updating your wardrobe</li>\r\n                        <li>Having your car professionally cleaned</li>\r\n                        <li>Investing your money</li>\r\n                        <li>Paying off a debt</li>\r\n                    </ul> \r\n                    <p class=\"question-text-pr-dr\">After six months of meeting your goal, reward yourself by spending the money you save on:</p>', '<h4 class=\'eh_subtitle h4_subtitle\'>Some final words on rewarding yourself</h4>\r\n\r\n<p> Remember to reward yourself every day, week and month. You\'ve developed a plan for these rewards, and you’ve saved some money… now take the time to enjoy yourself! You definitely deserve it!</p>', '<h4 class=\'eh_subtitle h4_subtitle\'>Some final words on rewarding yourself</h4>\r\n\r\n<p> Remember to reward yourself every day, week and month. You\'ve developed a plan for these rewards, and you’ve saved some money… now take the time to enjoy yourself! You definitely deserve it!</p>', 'p8_q6', 0, 1),
(67, 6, 10, 'Which of the following methods can help you deal with strong desires, urges or thoughts about drinking alcohol?', 'Which of the following methods can help you deal with strong desires, urges or thoughts about drinking alcohol?', '<p>It\'s normal for someone to experience strong desires, urges or thoughts when they cut down or\r\n                        quit drinking. It helps to recognize that these feelings are normal and that there are things\r\n                        you can do to make sure that you reach your <a href=\"/goals/other\" target=\"_blank\">goal</a>.\r\n                    </p>\r\n                    <p>Here are some of the ways that others have used to deal with strong urges, desires or thoughts.\r\n                        Pick the ones that might make sense to you. There\'s also a space for you to type in more\r\n                        specific methods that you might plan to use. You might also want to check with people in the\r\n                        community so you can see what\'s working for them.</p>', '<p>It\'s normal for someone to experience strong desires, urges or thoughts when they cut down or\r\n                        quit drinking. It helps to recognize that these feelings are normal and that there are things\r\n                        you can do to make sure that you reach your <a href=\"/goals/other\" target=\"_blank\">goal</a>.\r\n                    </p>\r\n                    <p>Here are some of the ways that others have used to deal with strong urges, desires or thoughts.\r\n                        Pick the ones that might make sense to you. There\'s also a space for you to type in more\r\n                        specific methods that you might plan to use. You might also want to check with people in the\r\n                        community so you can see what\'s working for them.</p>', NULL, NULL, 'p10_q1', 0, 0),
(68, 2, 10, 'What are some specific methods or strategies that will work for you? ', 'What are some specific methods or strategies that will work for you? ', '', '', NULL, NULL, 'p10_q2', 0, 0),
(69, 2, 10, NULL, NULL, NULL, NULL, NULL, NULL, 'p10_q3', 0, 1),
(70, 6, 11, 'Here are a few tips that can help you learn to say: \"No Thanks\". Put a check mark beside the tips that might help you:', 'Here are a few tips that can help you learn to say: \"No Thanks\". Put a check mark beside the tips that might help you:', '<p>Whether your goal is to cut down or stop drinking altogether, one of the most difficult tasks, at\r\n                        first, is learning how to say: \"No thanks\". It may be difficult at first, but as you practice,\r\n                        you\'ll find saying \"No thanks\" can become second nature.\r\n                    </p>\r\n                    <p>There are a large number of reasons why some people have a hard time saying: \"No thanks\". For\r\n                        example:</p>\r\n                    <ul class=\"tips-list\">\r\n                        <li>Some people are embarrassed and feel that they\'ll have to explain why they\'ve cut down or\r\n                            quit drinking.\r\n                        </li>\r\n                        <li>Some might feel that it won\'t matter if they have one more drink – or just one, period.\r\n                        </li>\r\n                        <li>If you\'re out with a new boss, friend, colleague or partner, you might believe that you\r\n                            might jeopardize your job or relationship if they find out the reason why you\'re always\r\n                            saying \"No thanks\" when offered a drink.\r\n                        </li>\r\n                        <li>The physical discomfort and temptation you feel might be too strong.</li>\r\n                        <li>If you don\'t drink you might feel like you just don\'t fit in.</li>\r\n                    </ul>\r\n                    <p>There are many, many other reasons why people can have a hard time saying: \"No Thanks\". And some\r\n                        are great at saying \"No Thanks\" for years - and then wake up the next day to find they\'ve had a\r\n                        <a data-toggle=\"modal\" href=\"#slip\">slip</a> or have <a data-toggle=\"modal\" href=\"#relapse\">relapsed</a>. It\r\n                        happens.</p>\r\n                    <p>No matter what your personal situation is, the best way to learn how to say \"No Thanks\" is to\r\n                        practice. Like anything else in life, you can only become good at something if you practice\r\n                        enough.</p>\r\n                    <p>Here are a few tips that can help you learn to say: \"No Thanks\". Put a check mark beside the tips\r\n                        that might help you:</p>\r\n\r\n                    <p>No matter what your personal situation is, the best way to learn how to say \"No Thanks\" is to\r\n                        practice. Like anything else in life, you can only become good at something if you practice\r\n                        enough.</p>', '<p>Whether your goal is to cut down or stop drinking altogether, one of the most difficult tasks, at\r\n                        first, is learning how to say: \"No thanks\". It may be difficult at first, but as you practice,\r\n                        you\'ll find saying \"No thanks\" can become second nature.\r\n                    </p>\r\n                    <p>There are a large number of reasons why some people have a hard time saying: \"No thanks\". For\r\n                        example:</p>\r\n                    <ul class=\"tips-list\">\r\n                        <li>Some people are embarrassed and feel that they\'ll have to explain why they\'ve cut down or\r\n                            quit drinking.\r\n                        </li>\r\n                        <li>Some might feel that it won\'t matter if they have one more drink – or just one, period.\r\n                        </li>\r\n                        <li>If you\'re out with a new boss, friend, colleague or partner, you might believe that you\r\n                            might jeopardize your job or relationship if they find out the reason why you\'re always\r\n                            saying \"No thanks\" when offered a drink.\r\n                        </li>\r\n                        <li>The physical discomfort and temptation you feel might be too strong.</li>\r\n                        <li>If you don\'t drink you might feel like you just don\'t fit in.</li>\r\n                    </ul>\r\n                    <p>There are many, many other reasons why people can have a hard time saying: \"No Thanks\". And some\r\n                        are great at saying \"No Thanks\" for years - and then wake up the next day to find they\'ve had a\r\n                        <a data-toggle=\"modal\" href=\"#slip\">slip</a> or have <a data-toggle=\"modal\" href=\"#relapse\">relapsed</a>. It\r\n                        happens.</p>\r\n                    <p>No matter what your personal situation is, the best way to learn how to say \"No Thanks\" is to\r\n                        practice. Like anything else in life, you can only become good at something if you practice\r\n                        enough.</p>\r\n                    <p>Here are a few tips that can help you learn to say: \"No Thanks\". Put a check mark beside the tips\r\n                        that might help you:</p>\r\n\r\n                    <p>No matter what your personal situation is, the best way to learn how to say \"No Thanks\" is to\r\n                        practice. Like anything else in life, you can only become good at something if you practice\r\n                        enough.</p>', NULL, NULL, 'p11_q1', 0, 0),
(71, 2, 11, 'Think of one or two other strategies that can help you feel better at saying “no thanks”:', 'Think of one or two other strategies that can help you feel better at saying “no thanks”:', '', '', NULL, NULL, 'p11_q2', 0, 0),
(72, 2, 11, NULL, NULL, NULL, NULL, NULL, NULL, 'p11_q3', 0, 1);
INSERT INTO `problem_drinking_form_question` (`id`, `type`, `problem_drinking_page_id`, `text`, `text_us`, `text_before_question`, `text_before_question_us`, `text_after_question`, `text_after_question_us`, `field_name`, `has_replace_text`, `hide_question`) VALUES
(73, 7, 12, NULL, NULL, '  <p>If you think back to when you weren’t concerned about your drinking, you might have met people at\r\n                        the bar, or you may have gotten to know someone over a few drinks at a club or restaurant. You\r\n                        may be into sports and enjoy going to get a few drinks after the game or maybe with coworkers\r\n                        after a long day’s work or with friends after a long day of studying.</p>\r\n                    <p>In those situations, it may have been easier to meet people, and since drinking can help lower\r\n                        your guard and make you more social, talking to strangers may seem easier.</p>\r\n                    <p>...and let\'s face it: dating and new relationships are tough enough without worrying about\r\n                        drinking or wondering what the other person will think if you tell them you\'ve had issues with\r\n                        alcohol.</p>\r\n                    <p>The good news is that once you\'re familiar with your <a href=\"/problem-drinking/session?pageId=5&sessionId=38\" target=\"_blank\">triggers</a> and\r\n                        you\'re comfortable with saying <a href=\"/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a>, alcohol\r\n                        shouldn\'t get\r\n                        in the way of developing new relationships, dating, or getting into a sexual relationship.</p>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">What\'s a Relationship Anyway?</h4>\r\n                    <p>First of all, let\'s think about why you get into relationships in the first place. Whether it\'s\r\n                        for companionship, finding a life partner or just for sex; a relationship is… well…. a\r\n                        relationship. And whether it\'s for life or for sex, all healthy relationships have a few things\r\n                        in common.</p>\r\n\r\n\r\n                    <ul class=\"tips-list\">\r\n                        <li>For example, when you\'re in a healthy relationship:</li>\r\n                        <li>you feel like you can confide in the other person,</li>\r\n                        <li>there\'s respect for each other\'s boundaries,</li>\r\n                        <li>you can trust your partner,</li>\r\n                        <li>you can enjoy each other when you\'re together and apart</li>\r\n                        <li>you have similar interests,</li>\r\n                        <li>you feel like you can meet each other\'s needs,</li>\r\n                        <li>you have similar values,</li>\r\n                        <li>you have freedom to be yourself.</li>\r\n                    </ul>\r\n                    <p>Notice that none of the above points say anything about the need to drink alcohol. There are\r\n                        many, many relationships where both partners don\'t drink, or one drinks and the other doesn\'t.\r\n                        The fact that you\'re cutting down or have quit drinking has absolutely nothing to do with your\r\n                        ability to find yourself in a healthy relationship.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How do I ask for a date</h4>\r\n                    <p>Regardless of your gender most people feel a combination of emotions when asking someone out on a\r\n                        date. For example, feeling nervous, excited, shy, embarrassed or anxious are all normal\r\n                        feelings. To ask someone out on a date under the influence may seem easier. However what people\r\n                        appreciate is a sober and honest approach with dating. Most people have been in the position of\r\n                        asking someone out, and therefore they will most likely understand your position of asking.\r\n                        Remember to be yourself and have fun. The following tips may be helpful:</p>\r\n\r\n                    <ul class=\"tips-list\">\r\n                        <li>Prepare what you would like to say ahead of time.</li>\r\n                        <li>Smile and look at the person who interests you, establish a connection before talking.</li>\r\n                        <li>Most people love to be complemented, look at the person and find something to complement\r\n                            them on (for example, “Yellow looks lovely on you, is that your favorite color?”).\r\n                        </li>\r\n                        <li>Pay attention to cues and how they respond to you.</li>\r\n                        <li>Think and act positively – this will create a positive space for you while asking the person\r\n                            out.\r\n                        </li>\r\n                        <li>Ask them about their interests and plan a date around their response.</li>\r\n                        <li>Be honest, if you are very nervous tell the person, but follow it up with a suggestion of\r\n                            spending time together.\r\n                        </li>\r\n                        <li>If the person says they are busy, ask them when they have free time to meet.</li>\r\n                        <li>Reward yourself for having the courage to ask a person out on a date, regardless of what\r\n                            their response is.\r\n                        </li>\r\n                        <li>Remember: People are like buses, there is always one around the corner. If the first few\r\n                            tries don’t work, keep trying!\r\n                        </li>\r\n                    </ul>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">When Should You Tell Someone about Your History with\r\n                        Alcohol?</h4>\r\n                    <p>Every single person has their own issues, history and quirks. However, it’s entirely normal to\r\n                        get to know a person a little bit (or at least have a few dates), before either of you start to\r\n                        disclose all of your heartfelt secrets and personal history. After all – what’s the rush?</p>\r\n                    <p>If you do go out on a date, there\'s no reason why you need to start your date at a restaurant\r\n                        where you may feel pressured to order a bottle of wine or have a few drinks. There are many,\r\n                        many other places that don\'t serve alcohol, or where you won\'t feel pressured to order a drink.\r\n                        Many of these places are great for getting to know someone, such as:</p>\r\n\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>the movies</li>\r\n                        <li>art gallery</li>\r\n                        <li>a sporting event</li>\r\n                        <li>taking your dog(s) for a walk</li>\r\n                        <li>skiing</li>\r\n                        <li>a picnic</li>\r\n                        <li>bowling</li>\r\n                        <li>fishing</li>\r\n                        <li>a church event</li>\r\n                        <li>a walk in the park</li>\r\n                        <li>a play</li>\r\n                        <li>going shopping</li>\r\n                        <li>scuba diving</li>\r\n                        <li>a coffee shop</li>\r\n                        <li>golfing</li>\r\n                        <li>a canoe trip</li>\r\n                        <li>a museum</li>\r\n                        <li>taking a class or study group</li>\r\n                    </ul>\r\n                    <p>... and that\'s just the beginning! Alcohol does not have to be a factor in getting to know\r\n                        someone.\r\n                        But if you find yourself entering into a healthy, open and honest relationship you will\r\n                        eventually need to discuss your history with alcohol. Although it\'s natural to feel nervous -\r\n                        it\'s probably not as big of a deal as you may think it is. Especially if you\'re able to show\r\n                        your partner that you know your triggers have no trouble saying: \"No thanks\", and have learned\r\n                        to control alcohol.\r\n                    </p>\r\n                    <p>In fact, if you really think about it, an attractive partner is one that\'s strong, is able to\r\n                        meet life\'s challenges, find solutions, and move forward. If you think about it that way, the\r\n                        very fact that you\'ve been able to control alcohol, rather than having it control you, is quite\r\n                        attractive - isn\'t it?\r\n                    </p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">What if the Person I\'m Interested in Really Likes to Drink?</h4>\r\n                    <p>If you\'re comfortable with your triggers, don\'t have any trouble saying: \"No thanks\", and if you\r\n                        get to the point where you don\'t have any physical discomfort around alcohol then there\'s no\r\n                        reason why you can\'t be around people who drink responsibly. You just need to be aware - and\r\n                        this might take some practice.\r\n                        If your partner decides that drinking is important to them, or if they decide to end the\r\n                        relationship because you don\'t drink, it\'s much better to know sooner rather than later. And\r\n                        quite simply, if that\'s what\'s important to them, then that type of person is not for you.\r\n                    </p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">That\'s Great – but how can I be Prepared?</h4>\r\n                    <p>One thing that\'s wonderful about relationships, especially when they begin to grow, is that they\r\n                        can be fun and spontaneous. Eventually you might find yourself in a situation where you need to\r\n                        honestly tell your new friend or partner about your history with alcohol.</p>\r\n                    <p>You may plan to tell your partner about your drinking at a time that\'s quiet or private. You\r\n                        might be surprised at how understanding your partner may be and it could even help you become\r\n                        close.\r\n                        Whenever the situation arises, you should be honest with the fact that you\'re either cutting\r\n                        down or have quit drinking. This doesn\'t need to be a big production, and unless asked you\r\n                        really don\'t need to go into great detail. However, we do realize that this can be hard, so it\r\n                        may help to practice beforehand. Here are some suggested statements that might help you prepare:\r\n                    </p>\r\n                    <p>\"Say, now that we\'ve gotten to know each other a little better there\'s something I think I\'d like\r\n                        to share with you...\", or</p>\r\n                    <p>\"There\'s never a perfect time to bring something like this up but it\'s important for me to let\r\n                        you know that...\", or</p>\r\n                    <p>\"I feel like I can be honest with you, so I need to tell you something that I only share with my\r\n                        close friends...\", or</p>\r\n                    <p>\"Everyone has something interesting in their lives, and there\'s been a couple of challenges that\r\n                        I\'ve had to deal with over the past few years...\"</p>\r\n                    <p>Again, as it\'s good to practice think of what you\'d say to a new partner, or even a new friend,\r\n                        if the topic of drinking came up. You don\'t have to finish this exercise right now. Feel free to\r\n                        think about it and come back later on: </p>', '  <p>If you think back to when you weren’t concerned about your drinking, you might have met people at\r\n                        the bar, or you may have gotten to know someone over a few drinks at a club or restaurant. You\r\n                        may be into sports and enjoy going to get a few drinks after the game or maybe with coworkers\r\n                        after a long day’s work or with friends after a long day of studying.</p>\r\n                    <p>In those situations, it may have been easier to meet people, and since drinking can help lower\r\n                        your guard and make you more social, talking to strangers may seem easier.</p>\r\n                    <p>...and let\'s face it: dating and new relationships are tough enough without worrying about\r\n                        drinking or wondering what the other person will think if you tell them you\'ve had issues with\r\n                        alcohol.</p>\r\n                    <p>The good news is that once you\'re familiar with your <a href=\"/problem-drinking/session?pageId=5&sessionId=38\" target=\"_blank\">triggers</a> and\r\n                        you\'re comfortable with saying <a href=\"/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a>, alcohol\r\n                        shouldn\'t get\r\n                        in the way of developing new relationships, dating, or getting into a sexual relationship.</p>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">What\'s a Relationship Anyway?</h4>\r\n                    <p>First of all, let\'s think about why you get into relationships in the first place. Whether it\'s\r\n                        for companionship, finding a life partner or just for sex; a relationship is… well…. a\r\n                        relationship. And whether it\'s for life or for sex, all healthy relationships have a few things\r\n                        in common.</p>\r\n\r\n\r\n                    <ul class=\"tips-list\">\r\n                        <li>For example, when you\'re in a healthy relationship:</li>\r\n                        <li>you feel like you can confide in the other person,</li>\r\n                        <li>there\'s respect for each other\'s boundaries,</li>\r\n                        <li>you can trust your partner,</li>\r\n                        <li>you can enjoy each other when you\'re together and apart</li>\r\n                        <li>you have similar interests,</li>\r\n                        <li>you feel like you can meet each other\'s needs,</li>\r\n                        <li>you have similar values,</li>\r\n                        <li>you have freedom to be yourself.</li>\r\n                    </ul>\r\n                    <p>Notice that none of the above points say anything about the need to drink alcohol. There are\r\n                        many, many relationships where both partners don\'t drink, or one drinks and the other doesn\'t.\r\n                        The fact that you\'re cutting down or have quit drinking has absolutely nothing to do with your\r\n                        ability to find yourself in a healthy relationship.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How do I ask for a date</h4>\r\n                    <p>Regardless of your gender most people feel a combination of emotions when asking someone out on a\r\n                        date. For example, feeling nervous, excited, shy, embarrassed or anxious are all normal\r\n                        feelings. To ask someone out on a date under the influence may seem easier. However what people\r\n                        appreciate is a sober and honest approach with dating. Most people have been in the position of\r\n                        asking someone out, and therefore they will most likely understand your position of asking.\r\n                        Remember to be yourself and have fun. The following tips may be helpful:</p>\r\n\r\n                    <ul class=\"tips-list\">\r\n                        <li>Prepare what you would like to say ahead of time.</li>\r\n                        <li>Smile and look at the person who interests you, establish a connection before talking.</li>\r\n                        <li>Most people love to be complemented, look at the person and find something to complement\r\n                            them on (for example, “Yellow looks lovely on you, is that your favorite color?”).\r\n                        </li>\r\n                        <li>Pay attention to cues and how they respond to you.</li>\r\n                        <li>Think and act positively – this will create a positive space for you while asking the person\r\n                            out.\r\n                        </li>\r\n                        <li>Ask them about their interests and plan a date around their response.</li>\r\n                        <li>Be honest, if you are very nervous tell the person, but follow it up with a suggestion of\r\n                            spending time together.\r\n                        </li>\r\n                        <li>If the person says they are busy, ask them when they have free time to meet.</li>\r\n                        <li>Reward yourself for having the courage to ask a person out on a date, regardless of what\r\n                            their response is.\r\n                        </li>\r\n                        <li>Remember: People are like buses, there is always one around the corner. If the first few\r\n                            tries don’t work, keep trying!\r\n                        </li>\r\n                    </ul>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">When Should You Tell Someone about Your History with\r\n                        Alcohol?</h4>\r\n                    <p>Every single person has their own issues, history and quirks. However, it’s entirely normal to\r\n                        get to know a person a little bit (or at least have a few dates), before either of you start to\r\n                        disclose all of your heartfelt secrets and personal history. After all – what’s the rush?</p>\r\n                    <p>If you do go out on a date, there\'s no reason why you need to start your date at a restaurant\r\n                        where you may feel pressured to order a bottle of wine or have a few drinks. There are many,\r\n                        many other places that don\'t serve alcohol, or where you won\'t feel pressured to order a drink.\r\n                        Many of these places are great for getting to know someone, such as:</p>\r\n\r\n                    <ul class=\"eh_custom_point_list tips-list two-cols\">\r\n                        <li>the movies</li>\r\n                        <li>art gallery</li>\r\n                        <li>a sporting event</li>\r\n                        <li>taking your dog(s) for a walk</li>\r\n                        <li>skiing</li>\r\n                        <li>a picnic</li>\r\n                        <li>bowling</li>\r\n                        <li>fishing</li>\r\n                        <li>a church event</li>\r\n                        <li>a walk in the park</li>\r\n                        <li>a play</li>\r\n                        <li>going shopping</li>\r\n                        <li>scuba diving</li>\r\n                        <li>a coffee shop</li>\r\n                        <li>golfing</li>\r\n                        <li>a canoe trip</li>\r\n                        <li>a museum</li>\r\n                        <li>taking a class or study group</li>\r\n                    </ul>\r\n                    <p>... and that\'s just the beginning! Alcohol does not have to be a factor in getting to know\r\n                        someone.\r\n                        But if you find yourself entering into a healthy, open and honest relationship you will\r\n                        eventually need to discuss your history with alcohol. Although it\'s natural to feel nervous -\r\n                        it\'s probably not as big of a deal as you may think it is. Especially if you\'re able to show\r\n                        your partner that you know your triggers have no trouble saying: \"No thanks\", and have learned\r\n                        to control alcohol.\r\n                    </p>\r\n                    <p>In fact, if you really think about it, an attractive partner is one that\'s strong, is able to\r\n                        meet life\'s challenges, find solutions, and move forward. If you think about it that way, the\r\n                        very fact that you\'ve been able to control alcohol, rather than having it control you, is quite\r\n                        attractive - isn\'t it?\r\n                    </p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">What if the Person I\'m Interested in Really Likes to Drink?</h4>\r\n                    <p>If you\'re comfortable with your triggers, don\'t have any trouble saying: \"No thanks\", and if you\r\n                        get to the point where you don\'t have any physical discomfort around alcohol then there\'s no\r\n                        reason why you can\'t be around people who drink responsibly. You just need to be aware - and\r\n                        this might take some practice.\r\n                        If your partner decides that drinking is important to them, or if they decide to end the\r\n                        relationship because you don\'t drink, it\'s much better to know sooner rather than later. And\r\n                        quite simply, if that\'s what\'s important to them, then that type of person is not for you.\r\n                    </p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">That\'s Great – but how can I be Prepared?</h4>\r\n                    <p>One thing that\'s wonderful about relationships, especially when they begin to grow, is that they\r\n                        can be fun and spontaneous. Eventually you might find yourself in a situation where you need to\r\n                        honestly tell your new friend or partner about your history with alcohol.</p>\r\n                    <p>You may plan to tell your partner about your drinking at a time that\'s quiet or private. You\r\n                        might be surprised at how understanding your partner may be and it could even help you become\r\n                        close.\r\n                        Whenever the situation arises, you should be honest with the fact that you\'re either cutting\r\n                        down or have quit drinking. This doesn\'t need to be a big production, and unless asked you\r\n                        really don\'t need to go into great detail. However, we do realize that this can be hard, so it\r\n                        may help to practice beforehand. Here are some suggested statements that might help you prepare:\r\n                    </p>\r\n                    <p>\"Say, now that we\'ve gotten to know each other a little better there\'s something I think I\'d like\r\n                        to share with you...\", or</p>\r\n                    <p>\"There\'s never a perfect time to bring something like this up but it\'s important for me to let\r\n                        you know that...\", or</p>\r\n                    <p>\"I feel like I can be honest with you, so I need to tell you something that I only share with my\r\n                        close friends...\", or</p>\r\n                    <p>\"Everyone has something interesting in their lives, and there\'s been a couple of challenges that\r\n                        I\'ve had to deal with over the past few years...\"</p>\r\n                    <p>Again, as it\'s good to practice think of what you\'d say to a new partner, or even a new friend,\r\n                        if the topic of drinking came up. You don\'t have to finish this exercise right now. Feel free to\r\n                        think about it and come back later on: </p>', NULL, NULL, 'p12_q1', 0, 1),
(74, 10, 14, 'Felt anxious, nervous or tense', 'Felt anxious, nervous or tense', '\r\n                                    <p>Whether you\'re cutting down or quitting, the first few weeks will be the hardest. This is\r\n                        generally true for everyone who makes some type of change in their lifestyle.</p>\r\n                    <p>Here\'s a typical example: Let\'s say that Alice, who was an athlete in school, notices that she\'s\r\n                        put on a little extra weight after starting a new job and decides that she wants to start\r\n                        exercising. She makes a personal pledge to wake up every morning at 6 am to go for a 20-minute\r\n                        jog and…</p>\r\n                    <p>On Monday she wakes up at 5:30 am, puts on her new shoes, and hits the street.</p>\r\n                    <ul class=\"tips-list\">\r\n                        <li>On Tuesday, although feeling a bit tired, she still manages to wake up and goes for her\r\n                            jog.\r\n                        </li>\r\n                        <li>On Wednesday morning, she\'s feeling a little sore, and although she still jogs, she\'s a\r\n                            little slower. She works late Wednesday evening and comes home feeling exhausted.\r\n                        </li>\r\n                        <li>On Thursday morning she hits the snooze button, just for an extra 15 minutes, but ends up\r\n                            sleeping through her alarm.\r\n                        </li>\r\n                        <li>Feeling guilty for missing her Thursday jog, while half asleep, Alice rolls over and hits\r\n                            the snooze button again. When the alarm goes off 15 minutes later she rolls over, turns off\r\n                            her alarm while thinking: \"I\'ll take the weekend off and start again on Monday\"...\r\n                        </li>\r\n                        <li>Monday never comes...</li>\r\n                    </ul>\r\n                    <p>There\'s any number of reasons why Alice didn\'t follow through with her plan: she may have not\r\n                        realized that waking up every day at 5:30 am and running was too big of a change, she may have\r\n                        decided to do too much at once, her plan may have been a bit unrealistic, or perhaps she didn\'t\r\n                        plan for <a data-toggle=\"modal\" href=\"#slip\">slips</a> or temptations.</p>\r\n                    <p>In this case, the snooze button was the temptation. Perhaps if she would have sat back and\r\n                        thought about how tempting the snooze button would be, she could have come up with some\r\n                        solutions. Perhaps she could have put the alarm across the room so she\'d have to get out of bed\r\n                        to turn it off, perhaps she could have taped a sign that said \"NO SNOOZING\" above the snooze\r\n                        button…</p>\r\n                    <p>Here\'s another example. If you talk to someone who quit smoking, they\'ll most likely tell you\r\n                        that the first two weeks were the hardest. In fact, the term \"Hell Week\" is generally the name\r\n                        the smokers give to their first week of being smoke-free. This is followed by \"Heck Week\", which\r\n                        is not as bad as Hell Week, but is still pretty tough. Successful quitters who make it through\r\n                        Hell Week and Heck Week usually have a good quit plan, a support team, an <a href=\"/problem-drinking/session?pageId=15&sessionId=39\" target=\"_blank\">Emergency Coping Plan</a>\r\n                         and have panned ahead for temptations. Most quitters find that as\r\n                        time goes by, the strong urge to smoke begins to fade. However, they\'re also aware that\r\n                        temptation is always waiting around the corner...</p>\r\n                    <p>So, if you\'re cutting down or quitting drinking, you need to plan for temptations. Everyone has\r\n                        different temptations, but once you get to know them, you\'re better equipped to deal with them\r\n                        when they sneak up on you.</p> <p>How tempted would you be to slip if you:</p>', '\r\n                                    <p>Whether you\'re cutting down or quitting, the first few weeks will be the hardest. This is\r\n                        generally true for everyone who makes some type of change in their lifestyle.</p>\r\n                    <p>Here\'s a typical example: Let\'s say that Alice, who was an athlete in school, notices that she\'s\r\n                        put on a little extra weight after starting a new job and decides that she wants to start\r\n                        exercising. She makes a personal pledge to wake up every morning at 6 am to go for a 20-minute\r\n                        jog and…</p>\r\n                    <p>On Monday she wakes up at 5:30 am, puts on her new shoes, and hits the street.</p>\r\n                    <ul class=\"tips-list\">\r\n                        <li>On Tuesday, although feeling a bit tired, she still manages to wake up and goes for her\r\n                            jog.\r\n                        </li>\r\n                        <li>On Wednesday morning, she\'s feeling a little sore, and although she still jogs, she\'s a\r\n                            little slower. She works late Wednesday evening and comes home feeling exhausted.\r\n                        </li>\r\n                        <li>On Thursday morning she hits the snooze button, just for an extra 15 minutes, but ends up\r\n                            sleeping through her alarm.\r\n                        </li>\r\n                        <li>Feeling guilty for missing her Thursday jog, while half asleep, Alice rolls over and hits\r\n                            the snooze button again. When the alarm goes off 15 minutes later she rolls over, turns off\r\n                            her alarm while thinking: \"I\'ll take the weekend off and start again on Monday\"...\r\n                        </li>\r\n                        <li>Monday never comes...</li>\r\n                    </ul>\r\n                    <p>There\'s any number of reasons why Alice didn\'t follow through with her plan: she may have not\r\n                        realized that waking up every day at 5:30 am and running was too big of a change, she may have\r\n                        decided to do too much at once, her plan may have been a bit unrealistic, or perhaps she didn\'t\r\n                        plan for <a data-toggle=\"modal\" href=\"#slip\">slips</a> or temptations.</p>\r\n                    <p>In this case, the snooze button was the temptation. Perhaps if she would have sat back and\r\n                        thought about how tempting the snooze button would be, she could have come up with some\r\n                        solutions. Perhaps she could have put the alarm across the room so she\'d have to get out of bed\r\n                        to turn it off, perhaps she could have taped a sign that said \"NO SNOOZING\" above the snooze\r\n                        button…</p>\r\n                    <p>Here\'s another example. If you talk to someone who quit smoking, they\'ll most likely tell you\r\n                        that the first two weeks were the hardest. In fact, the term \"Hell Week\" is generally the name\r\n                        the smokers give to their first week of being smoke-free. This is followed by \"Heck Week\", which\r\n                        is not as bad as Hell Week, but is still pretty tough. Successful quitters who make it through\r\n                        Hell Week and Heck Week usually have a good quit plan, a support team, an <a href=\"/problem-drinking/session?pageId=15&sessionId=39\" target=\"_blank\">Emergency Coping Plan</a>\r\n                         and have panned ahead for temptations. Most quitters find that as\r\n                        time goes by, the strong urge to smoke begins to fade. However, they\'re also aware that\r\n                        temptation is always waiting around the corner...</p>\r\n                    <p>So, if you\'re cutting down or quitting drinking, you need to plan for temptations. Everyone has\r\n                        different temptations, but once you get to know them, you\'re better equipped to deal with them\r\n                        when they sneak up on you.</p> <p>How tempted would you be to slip if you:</p>', NULL, NULL, 'tempted', 0, 0),
(75, 10, 14, 'Were bored', 'Were bored', NULL, NULL, NULL, NULL, 'tempted', 0, 0),
