(77, 10, 14, 'Felt that drinking is part of your self-image', 'Felt that drinking is part of your self-image', NULL, NULL, NULL, NULL, 'tempted', 0, 0),
(78, 10, 14, 'Wanted to feel mature and sophisticated', 'Wanted to feel mature and sophisticated', NULL, NULL, NULL, NULL, 'tempted', 0, 0),
