(82, 10, 14, 'Wanted to relax', 'Wanted to relax', NULL, NULL, NULL, NULL, 'tempted', 0, 0),
(83, 10, 14, 'Were handed a drink from someone who doesn\'t know you\'ve quit or cut down', 'Were handed a drink from someone who doesn\'t know you\'ve quit or cut down', NULL, NULL, NULL, NULL, 'tempted', 0, 0),
