(91, 10, 14, 'Feeling great, and wanting a drink because it\'ll make me feel even better or more social', 'Feeling great, and wanting a drink because it\'ll make me feel even better or more social', NULL, NULL, NULL, NULL, 'tempted', 0, 0),
(92, 2, 14, 'Are there any other situations in which you would feel tempted? ', 'Are there any other situations in which you would feel tempted? ', NULL, NULL, NULL, NULL, 'p14_q2', 0, 0),
(93, 2, 14, NULL, NULL, NULL, NULL, NULL, NULL, 'p14_q3', 0, 1),
(94, 6, 18, 'Check off the following items that you can easily fit into your lifestyle. There’s also space at the bottom where you can add other, more personal, choices.', 'Check off the following items that you can easily fit into your lifestyle. There’s also space at the bottom where you can add other, more personal, choices.', '  <p>Being physically active makes you feel good, and it can improve your well-being and attitude\r\n                        toward life. Any type of physical activity will do... as long as you’re active each day.</p>\r\n                    <p>When you feel yourself thinking about drinking, or if you have an intense craving for a drink,\r\n                        some of the ideas listed below can distract you, and they can easily be added to your daily\r\n                        routine.</p>\r\n                    <p>If you choose a physical activity that will keep you distracted, be sure to choose one that you\r\n                        enjoy – keeping active doesn\'t have to be a chore! It might be important to also remind yourself\r\n                        that physical activity also keeps your mind healthy, and once you start, you might find that you\r\n                        have more energy.</p>', '  <p>Being physically active makes you feel good, and it can improve your well-being and attitude\r\n                        toward life. Any type of physical activity will do... as long as you’re active each day.</p>\r\n                    <p>When you feel yourself thinking about drinking, or if you have an intense craving for a drink,\r\n                        some of the ideas listed below can distract you, and they can easily be added to your daily\r\n                        routine.</p>\r\n                    <p>If you choose a physical activity that will keep you distracted, be sure to choose one that you\r\n                        enjoy – keeping active doesn\'t have to be a chore! It might be important to also remind yourself\r\n                        that physical activity also keeps your mind healthy, and once you start, you might find that you\r\n                        have more energy.</p>', NULL, NULL, 'p18_q1', 0, 0),
(95, 2, 18, 'Think of one or two other ways that can help you stay physically active, and can help distract yourself if you feel like you may have a <a data-toggle=\"modal\" href=\"#slip\">slip</a>:', 'Think of one or two other ways that can help you stay physically active, and can help distract yourself if you feel like you may have a <a data-toggle=\"modal\" href=\"#slip\">slip</a>:', NULL, NULL, NULL, NULL, 'p18_q2', 0, 0),
(96, 2, 18, NULL, NULL, NULL, NULL, NULL, NULL, 'p18_q3', 0, 1),
(97, 6, 19, 'Here are some healthy eating substitutes that you could use to reduce the urge to eat junk food. Check off the suggestions that will really work for you. ', 'Here are some healthy eating substitutes that you could use to reduce the urge to eat junk food. Check off the suggestions that will really work for you. ', '  <p>For some people, cutting down or quitting drinking can lead to an increase in appetite. This is\r\n                        normal, and the good news is that there are many healthy alternatives to junk food that\'ll keep\r\n                        your hands busy and your belly happy.</p>\r\n                    <p>If you\'ve added <a href=\"/problem-drinking/session?pageId=18&sessionId=40\" target=\"_blank\">physical activity</a> to your daily routine, weight gain\r\n                        from cutting down or quitting drinking isn\'t as likely.</p>\r\n                    <p>Two things seem to cause weight gain after someone quits or cuts down. First, alcohol does\r\n                        contain calories (mostly non-nutritious calories), so if you aren\'t drinking, you may feel the\r\n                        need to replace unhealthy calories with healthy calories. Second, you may use food to replace\r\n                        the habit of drinking and this may cause you to eat a bit more than before.\r\n                    </p>\r\n                    <p>You do have control over both of the above causes. First, if you increase your physical activity,\r\n                        you\'ll burn more calories, so you\'ll need to eat more. Second, you can substitute low-fat snacks\r\n                        (nutritious calories) in place of the non-nutritious calories your body digested through\r\n                        drinking.\r\n                    </p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How Can I Avoid Gaining Weight?</h4>\r\n                    <ul class=\"tips-list\">\r\n                        <li>Eat healthy, tasty, well-balanced meals as much as possible. Avoid fad diets.</li>\r\n                        <li>Since food may taste better after you reduce or quit drinking, you may want bigger helpings. Try to eat the same amount as usual.  </li>\r\n                        <li>Eat low-fat snacks fruits, veggies or crackers, instead of fast food, donuts, candy, or potato chips.</li>\r\n                    </ul>', '  <p>For some people, cutting down or quitting drinking can lead to an increase in appetite. This is\r\n                        normal, and the good news is that there are many healthy alternatives to junk food that\'ll keep\r\n                        your hands busy and your belly happy.</p>\r\n                    <p>If you\'ve added <a href=\"/problem-drinking/session?pageId=18&sessionId=40\" target=\"_blank\">physical activity</a> to your daily routine, weight gain\r\n                        from cutting down or quitting drinking isn\'t as likely.</p>\r\n                    <p>Two things seem to cause weight gain after someone quits or cuts down. First, alcohol does\r\n                        contain calories (mostly non-nutritious calories), so if you aren\'t drinking, you may feel the\r\n                        need to replace unhealthy calories with healthy calories. Second, you may use food to replace\r\n                        the habit of drinking and this may cause you to eat a bit more than before.\r\n                    </p>\r\n                    <p>You do have control over both of the above causes. First, if you increase your physical activity,\r\n                        you\'ll burn more calories, so you\'ll need to eat more. Second, you can substitute low-fat snacks\r\n                        (nutritious calories) in place of the non-nutritious calories your body digested through\r\n                        drinking.\r\n                    </p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How Can I Avoid Gaining Weight?</h4>\r\n                    <ul class=\"tips-list\">\r\n                        <li>Eat healthy, tasty, well-balanced meals as much as possible. Avoid fad diets.</li>\r\n                        <li>Since food may taste better after you reduce or quit drinking, you may want bigger helpings. Try to eat the same amount as usual.  </li>\r\n                        <li>Eat low-fat snacks fruits, veggies or crackers, instead of fast food, donuts, candy, or potato chips.</li>\r\n                    </ul>', NULL, NULL, 'p19_q1', 0, 0),
(98, 2, 19, 'Think of one or two other ways that you can avoid over eating:  ', 'Think of one or two other ways that you can avoid over eating:  ', NULL, NULL, NULL, NULL, 'p19_q2', 0, 0),
