INSERT INTO `problem_drinking_form_question` (`id`, `type`, `problem_drinking_page_id`, `text`, `text_us`, `text_before_question`, `text_before_question_us`, `text_after_question`, `text_after_question_us`, `field_name`, `has_replace_text`, `hide_question`) VALUES
(100, 6, 20, 'Here are some different ways of coping with stress that you can easily add to your daily routine. Check off those that would work for you. There is space at the bottom to add other choices.', 'Here are some different ways of coping with stress that you can easily add to your daily routine. Check off those that would work for you. There is space at the bottom to add other choices.', ' <p>As you might already know, many people drink because they feel it makes them relax or deal with\r\n                        stress. And it seems to be a part of our culture: we\'ve all seen the typical T.V. show where the\r\n                        stressed out lawyer has a drink after a difficult case, or where the business executive loosens\r\n                        their tie after a tough negotiation, then grabs a bottle of whiskey or scotch to \"calm their\r\n                        nerves\".</p>\r\n                    <p>On T.V. it\'s also typical to see \"the girls\" getting together at a bar to talk about life over\r\n                        drinks, construction workers tossing around beers from a cooler after a hard day’s work, or\r\n                        after making lunches and shuttling the kids around to soccer or swimming practice, the\r\n                        stay-at-home mom sitting and inviting the neighbor over for a bottle of wine.</p>\r\n                    <p>But it\'s important to remember that although these images seem romantic – they\'re not real.\r\n                        They\'re fiction. While many people drink moderately, most successful people find other ways to\r\n                        cope with their stress. While some feel that <a href=\"/problem-drinking/session?pageId=18&sessionId=40\" target=\"_blank\">exercise</a> helps them relax\r\n                        and recharge, there are many other ways to cope with stress - ways that don\'t involve the need\r\n                        to drink.</p>\r\n                    <p>Stress is a normal part of everyone\'s life and there are healthy ways of dealing with it. You can\r\n                        lean on your support network if you\'re feeling stressed, or you can change the way you respond\r\n                        to stress and you can learn to relax by listening to soft music, having a nice hot bath or\r\n                        shower, going for a brisk walk, reading a good book, or practicing relaxation exercises.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How do I reduce my stress?</h4>\r\n                    <p>You can try to change the source of your stress. For example, if you\'re having a conflict with\r\n                        someone, try talking about your differences. Find some \"middle ground\" that you both can live\r\n                        with.</p>\r\n                    <p>Sometimes you have to be assertive and let others know how you feel about their actions. You also\r\n                        need to look for alternate ways of dealing with a stressful situation. The more you prepare and\r\n                        the more options you have for coping, the lower your stress. Don\'t rely on a single coping\r\n                        strategy to deal with stress – give yourself as many options as possible.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How do I respond to stress now – should I change how I respond?</h4>\r\n                \r\n                    <p>Sometimes, no matter how hard you try, you just can\'t change the source of your stress. You have\r\n                        to accept that you can\'t change what other people do or say. All you can really do is change\r\n                        what you do, what you say and how you feel.</p>\r\n                    <p>Don\'t give the control of your emotions to another person. Tell yourself there\'s no reason why\r\n                        someone else\'s behavior should ruin your day. You can also attempt to change what a high stress\r\n                        situation means to you. If you have a big assignment coming up, avoid thinking that your entire\r\n                        career or self-worth depends on how well you do. Your life is very seldom changed in a single\r\n                        instant. Do your best and remind yourself that there will always be more opportunities in the\r\n                        future. Don\'t expect perfection.</p>\r\n                    <p>You can learn other ways to relax that don\'t involve drinking. Perhaps try one of the breathing\r\n                        techniques below. They\'re easy and you can use them anywhere without anyone knowing what you are\r\n                        doing. After all, people expect you to breathe. How you breathe is the important part.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How could deep breathing help me?</h4>\r\n                    <p>Instead of yelling, slamming doors, or focusing on drinking, take a slow deep breath in through\r\n                        your nose to the slow count of five. Push your belly out at the same time; this makes the air go\r\n                        deeply into your lungs. Slowly breathe out through your mouth to the count of seven. Repeat this\r\n                        3 times as you feel yourself relaxing and the stress dropping away.</p>\r\n                    <p>Normally when we think about breathing, we think of it as having two parts: breathing in and\r\n                        breathing out. Not anymore. We want you to think about breathing as having four parts, like a\r\n                        square or a box. Breathing in and breathing out are two sides of the box, but there are two more\r\n                        sides. It\'s the two other sides that we want you to focus on.</p>\r\n                    <div class=\"img-healthy-weight\" style=\"text-align:  center\">\r\n                        <img name=\"breathing\" src=\"../uploads/smoking-session/breathe.png\" alt=\"img\">\r\n                    </div>\r\n                    <p>If you pay attention to your breathing, you\'ll notice it has four parts. We breathe in and we\r\n                        breathe out (sides 1 and 3), but we also actually pause twice with each cycle. We pause once\r\n                        after we breathe in, and once after we breathe out. So, our breathing really goes like this,\r\n                        breathe in on one, pause on two, breathe out on three, pause on four, breathe in on one, pause\r\n                        on two, breathe out on three, pause…</p>\r\n                    <p>Sometimes it\'s easier to notice the pauses. When we\'re very relaxed the pauses are <b>easy</b> to\r\n                        spot.\r\n                        When we\'re exercising or panicking, the pauses are <b>harder</b> to spot. But, they\'re\r\n                        <b>always</b> there, no\r\n                        matter what. You can\'t get rid of the pauses!</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How could tension releasing help me?</h4>\r\n                    <p>You can do this wherever you are, whenever you feel the need.</p>\r\n                    <ol class=\"eh_custom_list\">\r\n                        <li>Let go of the tension in your neck and shoulders.</li>\r\n                        <li>Let go of the tension in your jaw.</li>\r\n                        <li>Focus completely on your breathing, nothing else.</li>\r\n                        <li>As you exhale, let your shoulders drop (relax) and let your body \"sink\" into the chair or\r\n                            the floor.\r\n                        </li>\r\n                    </ol>\r\n                    <p>Repeat this until you feel relaxed and centered.</p>\r\n                    <p>Remember, these breathing and relaxing techniques are skills. You have to practice them. Choose\r\n                        the one you like best and do it four or five times a day for the next few weeks. When you become\r\n                        good at it, you\'ll be able to relax quickly and completely. You\'ll realize that you\'re reducing\r\n                        your mental stress as well as your physical stress. You\'ll feel revived, refreshed, and ready to\r\n                        go on with drinking less or not drinking at all.</p>', ' <p>As you might already know, many people drink because they feel it makes them relax or deal with\r\n                        stress. And it seems to be a part of our culture: we\'ve all seen the typical T.V. show where the\r\n                        stressed out lawyer has a drink after a difficult case, or where the business executive loosens\r\n                        their tie after a tough negotiation, then grabs a bottle of whiskey or scotch to \"calm their\r\n                        nerves\".</p>\r\n                    <p>On T.V. it\'s also typical to see \"the girls\" getting together at a bar to talk about life over\r\n                        drinks, construction workers tossing around beers from a cooler after a hard day’s work, or\r\n                        after making lunches and shuttling the kids around to soccer or swimming practice, the\r\n                        stay-at-home mom sitting and inviting the neighbor over for a bottle of wine.</p>\r\n                    <p>But it\'s important to remember that although these images seem romantic – they\'re not real.\r\n                        They\'re fiction. While many people drink moderately, most successful people find other ways to\r\n                        cope with their stress. While some feel that <a href=\"/problem-drinking/session?pageId=18&sessionId=40\" target=\"_blank\">exercise</a> helps them relax\r\n                        and recharge, there are many other ways to cope with stress - ways that don\'t involve the need\r\n                        to drink.</p>\r\n                    <p>Stress is a normal part of everyone\'s life and there are healthy ways of dealing with it. You can\r\n                        lean on your support network if you\'re feeling stressed, or you can change the way you respond\r\n                        to stress and you can learn to relax by listening to soft music, having a nice hot bath or\r\n                        shower, going for a brisk walk, reading a good book, or practicing relaxation exercises.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How do I reduce my stress?</h4>\r\n                    <p>You can try to change the source of your stress. For example, if you\'re having a conflict with\r\n                        someone, try talking about your differences. Find some \"middle ground\" that you both can live\r\n                        with.</p>\r\n                    <p>Sometimes you have to be assertive and let others know how you feel about their actions. You also\r\n                        need to look for alternate ways of dealing with a stressful situation. The more you prepare and\r\n                        the more options you have for coping, the lower your stress. Don\'t rely on a single coping\r\n                        strategy to deal with stress – give yourself as many options as possible.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How do I respond to stress now – should I change how I respond?</h4>\r\n                \r\n                    <p>Sometimes, no matter how hard you try, you just can\'t change the source of your stress. You have\r\n                        to accept that you can\'t change what other people do or say. All you can really do is change\r\n                        what you do, what you say and how you feel.</p>\r\n                    <p>Don\'t give the control of your emotions to another person. Tell yourself there\'s no reason why\r\n                        someone else\'s behavior should ruin your day. You can also attempt to change what a high stress\r\n                        situation means to you. If you have a big assignment coming up, avoid thinking that your entire\r\n                        career or self-worth depends on how well you do. Your life is very seldom changed in a single\r\n                        instant. Do your best and remind yourself that there will always be more opportunities in the\r\n                        future. Don\'t expect perfection.</p>\r\n                    <p>You can learn other ways to relax that don\'t involve drinking. Perhaps try one of the breathing\r\n                        techniques below. They\'re easy and you can use them anywhere without anyone knowing what you are\r\n                        doing. After all, people expect you to breathe. How you breathe is the important part.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How could deep breathing help me?</h4>\r\n                    <p>Instead of yelling, slamming doors, or focusing on drinking, take a slow deep breath in through\r\n                        your nose to the slow count of five. Push your belly out at the same time; this makes the air go\r\n                        deeply into your lungs. Slowly breathe out through your mouth to the count of seven. Repeat this\r\n                        3 times as you feel yourself relaxing and the stress dropping away.</p>\r\n                    <p>Normally when we think about breathing, we think of it as having two parts: breathing in and\r\n                        breathing out. Not anymore. We want you to think about breathing as having four parts, like a\r\n                        square or a box. Breathing in and breathing out are two sides of the box, but there are two more\r\n                        sides. It\'s the two other sides that we want you to focus on.</p>\r\n                    <div class=\"img-healthy-weight\" style=\"text-align:  center\">\r\n                        <img name=\"breathing\" src=\"../uploads/smoking-session/breathe.png\" alt=\"img\">\r\n                    </div>\r\n                    <p>If you pay attention to your breathing, you\'ll notice it has four parts. We breathe in and we\r\n                        breathe out (sides 1 and 3), but we also actually pause twice with each cycle. We pause once\r\n                        after we breathe in, and once after we breathe out. So, our breathing really goes like this,\r\n                        breathe in on one, pause on two, breathe out on three, pause on four, breathe in on one, pause\r\n                        on two, breathe out on three, pause…</p>\r\n                    <p>Sometimes it\'s easier to notice the pauses. When we\'re very relaxed the pauses are <b>easy</b> to\r\n                        spot.\r\n                        When we\'re exercising or panicking, the pauses are <b>harder</b> to spot. But, they\'re\r\n                        <b>always</b> there, no\r\n                        matter what. You can\'t get rid of the pauses!</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How could tension releasing help me?</h4>\r\n                    <p>You can do this wherever you are, whenever you feel the need.</p>\r\n                    <ol class=\"eh_custom_list\">\r\n                        <li>Let go of the tension in your neck and shoulders.</li>\r\n                        <li>Let go of the tension in your jaw.</li>\r\n                        <li>Focus completely on your breathing, nothing else.</li>\r\n                        <li>As you exhale, let your shoulders drop (relax) and let your body \"sink\" into the chair or\r\n                            the floor.\r\n                        </li>\r\n                    </ol>\r\n                    <p>Repeat this until you feel relaxed and centered.</p>\r\n                    <p>Remember, these breathing and relaxing techniques are skills. You have to practice them. Choose\r\n                        the one you like best and do it four or five times a day for the next few weeks. When you become\r\n                        good at it, you\'ll be able to relax quickly and completely. You\'ll realize that you\'re reducing\r\n                        your mental stress as well as your physical stress. You\'ll feel revived, refreshed, and ready to\r\n                        go on with drinking less or not drinking at all.</p>', NULL, NULL, 'p20_q1', 0, 0),
(101, 2, 20, 'If you feel stressed and are beginning to focus on alcohol, think of one or two other ways that can help you ease your stress and get your mind back on track:', 'If you feel stressed and are beginning to focus on alcohol, think of one or two other ways that can help you ease your stress and get your mind back on track:', NULL, NULL, NULL, NULL, 'p20_q2', 0, 0),
