(13, 'What about Medications?', ' <p>If your goal is to quit drinking and you\'re having a tough time staying \r\n<a data-toggle=\"modal\" href=\"#abstaining\">abstinent</a> \r\n                        you might want to talk to your doctor about using some medical products that can\r\n                        help ease withdrawal symptoms and cravings. Using a product to help you quit drinking is a\r\n                        personal decision, so here\'s some information that can help you out.</p>\r\n                    <p>However, what\'s important for you to realize is that these products will NOT make you stay\r\n                        abstinent. Only YOU can make yourself quit drinking, and medical products may help with many of\r\n                        the uncomfortable feelings of withdrawal. Different medications help you in different ways so if\r\n                        you do decide to use medication, make sure you know what it\'s going to do for you.</p>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">Do I need to quit drinking before I start taking\r\n                        medications?</h4>\r\n                    <p>This varies and will be up to you and your doctor, but generally it\'s a good idea to be\r\n                        alcohol-free for a number of days before you start taking a medication.</p>\r\n                    <p>Some medications allow you to keep drinking (again – sort this out with your doctor) but before\r\n                        you start taking a medication you should definitely set your <a href=\"/goals/other\" target=\"_blank\">goal</a>. Even\r\n                        if your goal is to cut down, having a clear goal will give you something to work toward.</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How do I figure out if I need to use a medication?</h4>\r\n                    <p>The only people who can answer this question are you and your doctor. Don\'t be afraid to talk to\r\n                        your doctor about your drinking or using a medication – it\'s their job to help you and you\'re\r\n                        not alone. Many, many people talk to their doctor about alcohol.</p>\r\n                    <p>You might want to talk to your doctor about <a data-toggle=\"modal\" href=\"#slip\">slips</a>. If you\'re having a tough\r\n                        time, medication can help you reach your goal.</p>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How long do I stay on them?</h4>\r\n                    <p>Slips and strong <a data-toggle=\"modal\" href=\"#withdrawal-symptoms\">withdrawal symptoms</a> can be very, very high for the first 6\r\n                        to 12 months so your doctor will most likely recommend that you keep taking your medication for\r\n                        at least three months. But this will depend on your unique situations.</p>\r\n                    <p>Some people continue to use medications for many, many years. You also need to be very careful\r\n                        when you stop using them as strong cravings and temptations might come back.</p>\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">What if I\'m taking other drugs or medications?</h4>\r\n\r\n                    <p>You definitely need to tell your doctor if you\'re taking any other drugs (illegal or legal) as\r\n                        there could be some serious <a data-toggle=\"modal\" href=\"#side-effects\">side effects</a>. Don\'t be afraid to be honest with\r\n                        your doctor – your doctor\'s job is to help you.</p>\r\n                    <p>If you have a tough time talking to your doctor, or if you feel that your doctor is being\r\n                        judgmental, don\'t be afraid to seek help from other professionals. A lot of people have issues\r\n                        with alcohol. You\'re not alone, so make sure you feel comfortable and you\'re able to tell your\r\n                        doctor how you\'re feeling.\r\n                    </p>\r\n\r\n\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">What are the medications for alcohol dependence?</h4>\r\n                  \r\n                        <p>There are four main medical treatments that your doctor can prescribe for you. However, each\r\n                            one\r\n                            has their own unique benefits and side effects.</p>\r\n                        <p><b>Please Note: </b>The information listed below is not complete and is only intended to help\r\n                            prepare you for a discussion with your doctor. A qualified medical professional is the only\r\n                            person who can tell you how any medications will work with your unique situation or body\r\n                            chemistry.</p>\r\n                    <div class=\"small-padding-paragraph\">\r\n                        <p><b>Drug name: </b>Acamprosate</p>\r\n                        <p><b>How do I take it?</b> Orally</p>\r\n                        <p><b>How often do I take it? </b>Three times a day</p>\r\n                        <p><b>What does it do? </b>This drug generally helps with some of the strong withdrawal symptoms\r\n                            you might experience, such as restlessness, anxiety, difficulty sleeping, fidgeting, and\r\n                            unease or depression\r\n                        </p>\r\n                    </div>\r\n                    <div class=\"small-padding-paragraph\">\r\n                        <p><b>Drug name: </b>Disulfiram</p>\r\n                        <p><b>How do I take it? </b>Orally</p>\r\n                        <p><b>How often do I take it? </b>Once per day</p>\r\n                        <p><b>What does it do? </b>? If you drink alcohol while you\'re on this drug, you\'ll experience\r\n                            really unpleasant physical reactions. If you drink you might feel very sick to your stomach,\r\n                            experience flushing or experience strong heart palpitations.</p>\r\n                    </div>\r\n\r\n                    <div class=\"small-padding-paragraph\">\r\n                        <p><b>Drug name: </b>Naltrexone</p>\r\n                        <p><b>How do I take it? </b>Orally or as an injection</p>\r\n                        <p><b>How often do I take it? </b>Once per day if taken orally; once monthly if you receive an\r\n                            injection.</p>\r\n                        <p><b>What does it do? </b>This drug seems to help people who are trying to cut down on heavy\r\n                            drinking and seems to reduce slips.</p>\r\n                    </div>\r\n\r\n\r\n                    <div class=\"small-padding-paragraph\">\r\n                        <p><b>Drug name: </b>Topiramate</p>\r\n                        <p><b>How do I take it? </b>Orally</p>\r\n                        <p><b>How often do I take it? </b>You generally keep visiting your doctor until you find a dose\r\n                            that\'s working for you.</p>\r\n                        <p><b>What does it do? </b>This drug seems to help make heavy drinking less appealing by\r\n                            changing some of your brain chemistry.</p>\r\n                        <p>If a particular medication is working for you, or if you want to learn about how medications\r\n                            may have helped others, please feel free to visit the community.</p>\r\n                    </div>', 'What about Medications?', 'What about Medications?', ' <p>If your goal is to quit drinking and you\'re having a tough time staying \r\n<a data-toggle=\"modal\" href=\"#abstaining\">abstinent</a> \r\n                        you might want to talk to your doctor about using some medical products that can\r\n                        help ease withdrawal symptoms and cravings. Using a product to help you quit drinking i