INSERT INTO `problem_drinking_page` (`id`, `title`, `text`, `title_us`, `title_de`, `text_us`, `text_de`, `type`, `module_quiz_id`, `has_replace_text`, `is_interactive_form`) VALUES
(17, 'Your Support Team', '\n                  <div class=\"quiz-content\">\n                    <p>Having a good support network can really help you stay on track to reaching your goals. Whether\n                        you are finding support within your family, friends or colleagues, it’s important to have people\n                        who will encourage you with your new lifestyle habits. If you’re finding that your family,\n                        friends and colleagues are not being particularly supportive, there are many other avenues you\n                        can try to gain support. Our community is an anonymous group of people just like yourself that\n                        will not judge you. </p>\n                    <p>Your Support Team can help in many, many ways. As you get used to cutting down or not drinking,\n                        they can serve non-alcoholic beverages during family and social gatherings. If you find yourself\n                        in a <a href=\"/problem-drinking/session?pageId=5&sessionId=38\" target=\"_blank\">trigger situation</a>, a good friend can quietly ask you if you’re OK or if\n                        you’d like to leave. </p>\n                    <p>Instead of heading to the bar or getting together for drinks, your Support Team can agree to get\n                        together in a different location; at least until you’re feeling confident and can be comfortable\n                        being around others who drink.</p>\n                    <p>Perhaps your friends and family can put bottles of alcohol away and not leave them out on the\n                        counter when you visit. Perhaps you can talk with your employer about temporarily having after\n                        work functions at restaurants that don’t serve alcohol. If you ask, you might be surprised to\n                        find that other co-workers might be interested in the same thing.</p>\n                    <p>There are many ideas that can make life less stressful, more healthy, social and enjoyable. If\n                        you have some great ideas, or if you need some ideas - why not ask in our community?</p>\n                    <h4 class=\"eh_subtitle h4_subtitle\">How else can I get my family and friends on board?</h4>\n                    <p>Here are a few suggestions:</p>\n                    <ol class=\"eh_custom_list problem-drinking-page\">\n                        <li>Enlist your friends and family to be a part of your Support Team. Tell them that their\n                            support is key to your success and that you\'d appreciate a boost of encouragement every now\n                            and again. And be sure to let them know how much you appreciate their support when they help\n                            keep you motivated. Let them know that your success is also their success!\n                        </li>\n                        <li>Be specific in your requests of people – use the assertive techniques that we’ve discussed\n                            in assertive communication. Give some thought as to what you really need and ask for it.\n                        </li>\n                        <li>Find ways to celebrate with friends and family that don’t involve alcohol. If a friend or\n                            family member is having a birthday or an anniversary, ask the person organizing the party to\n                            provide alternatives alcoholic drinks - like pop, tonic water, fruit juice or tea. Practice\n                            saying <a href=\"/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a> in a polite way before you attend the\n                            function and remember: there’s absolutely nothing to be ashamed about when you tell people\n                            that you’re making smart lifestyle changes. You may even inspire some others to make the\n                            same smart choice.\n                        </li>\n                        <li>Involve your family when creating your <a href=\"/problem-drinking/session?pageId=15&sessionId=39\" target=\"_blank\">coping plan</a>. Share some of\n                            the\n                            exercises in this program and let them know how they can all help you in achieving your\n                            goals. Remember that it’s also important to address areas of concern. For example, make sure\n                            that everyone knows that you won’t be offended when they do not to ask you to go out to a\n                            bar after work on Friday.\n                        </li>\n                        <li>Explain to your partner, roommate or family that one of your early coping strategies calls\n                            for the need for you to clear out the cupboards and fridge. Make sure that everyone\n                            understands that, for the time being, it’s important to keep the house or apartment free of\n                            alcohol.\n                        </li>\n                    </ol>\n                    <p>The Health Educators in our anonymous community are also a great resource. Stop by our community\n                        or use the Instant Messenger to communicate with another member. By reading about and sharing\n                        experiences, you’ll see how others are not only struggling with some of the exact same issues\n                        that you are, but they’re also succeeding - just like you!</p>\n                    <h4 class=\"eh_subtitle h4_subtitle\">Setbacks</h4>\n                    <p>Be prepared for setbacks and prepare your support squad for them. Help them to understand how\n                        you’ll handle <a data-toggle=\"modal\" href=\"#slip\">slips</a>.</p>\n                    <p>Setbacks do happen. There’ll be periods when you may feel compelled to go back to your past\n                        drinking patterns. When this happens, reach out to your Support Networks ASAP. Your Support\n                        Network is there to help you - so use them when you need them the most.</p>\n                    <p>\n                        When setbacks are about to occur, or when they do occur, these are the times when you should\n                        find your way to the Instant Messenger, Support Group or Health Educators so you can get some\n                        help. There’s bound to be someone going through the exact same thing you’re going through. After\n                        sharing, you’ll feel much better and you’ll be ready to start fresh with a new perspective.\n                    </p>\n                    <p>Or how about this: after you begin to succeed with this program, how about finding a new member\n                        that you can help out? New members will certainly be ready to learn from your experience,\n                        success and new-found wisdom. We bet that helping someone else out will make you feel good\n                        too.</p>\n\n\n                </div>\n                ', 'Your Support Team', 'Your Support Team', '\r\n                  <div class=\"quiz-content\">\r\n                    <p>Having a good support network can really help you stay on track to reaching your goals. Whether\r\n                        you are finding support within your family, friends or colleagues, it’s important to have people\r\n                        who will encourage you with your new lifestyle habits. If you’re finding that your family,\r\n                        friends and colleagues are not being particularly supportive, there are many other avenues you\r\n                        can try to gain support. Our community is an anonymous group of people just like yourself that\r\n                        will not judge you. </p>\r\n                    <p>Your Support Team can help in many, many ways. As you get used to cutting down or not drinking,\r\n                        they can serve non-alcoholic beverages during family and social gatherings. If you find yourself\r\n                        in a <a href=\"/problem-drinking/session?pageId=5&sessionId=38\" target=\"_blank\">trigger situation</a>, a good friend can quietly ask you if you’re OK or if\r\n                        you’d like to leave. </p>\r\n                    <p>Instead of heading to the bar or getting together for drinks, your Support Team can agree to get\r\n                        together in a different location; at least until you’re feeling confident and can be comfortable\r\n                        being around others who drink.</p>\r\n                    <p>Perhaps your friends and family can put bottles of alcohol away and not leave them out on the\r\n                        counter when you visit. Perhaps you can talk with your employer about temporarily having after\r\n                        work functions at restaurants that don’t serve alcohol. If you ask, you might be surprised to\r\n                        find that other co-workers might be interested in the same thing.</p>\r\n                    <p>There are many ideas that can make life less stressful, more healthy, social and enjoyable. If\r\n                        you have some great ideas, or if you need some ideas - why not ask in our community?</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">How else can I get my family and friends on board?</h4>\r\n                    <p>Here are a few suggestions:</p>\r\n                    <ol class=\"eh_custom_list problem-drinking-page\">\r\n                        <li>Enlist your friends and family to be a part of your Support Team. Tell them that their\r\n                            support is key to your success and that you\'d appreciate a boost of encouragement every now\r\n                            and again. And be sure to let them know how much you appreciate their support when they help\r\n                            keep you motivated. Let them know that your success is also their success!\r\n                        </li>\r\n                        <li>Be specific in your requests of people – use the assertive techniques that we’ve discussed\r\n                            in assertive communication. Give some thought as to what you really need and ask for it.\r\n                        </li>\r\n                        <li>Find ways to celebrate with friends and family that don’t involve alcohol. If a friend or\r\n                            family member is having a birthday or an anniversary, ask the person organizing the party to\r\n                            provide alternatives alcoholic drinks - like pop, tonic water, fruit juice or tea. Practice\r\n                            saying <a href=\"/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a> in a polite way before you attend the\r\n                            function and remember: there’s absolutely nothing to be ashamed about when you tell people\r\n                            that you’re making smart lifestyle changes. You may even inspire some others to make the\r\n                            same smart choice.\r\n                        </li>\r\n                        <li>Involve your family when creating your <a href=\"/problem-drinking/session?pageId=15&sessionId=39\" target=\"_blank\">coping plan</a>. Share some of\r\n                            the\r\n                            exercises in this program and let them know how they can all help you in achieving your\r\n                            goals. Remember that it’s also important to address areas of concern. For example, make sure\r\n                            that everyone knows that you won’t be offended when they do not to ask you to go out to a\r\n                            bar after work on Friday.\r\n                        </li>\r\n                        <li>Explain to your partner, roommate or family that one of your early coping strategies calls\r\n                            for the need for you to clear out the cupboards and fridge. Make sure that everyone\r\n                            understands that, for the time being, it’s important to keep the house or apartment free of\r\n                            alcohol.\r\n                        </li>\r\n                    </ol>\r\n                    <p>The Health Educators in our anonymous community are also a great resource. Stop by our community\r\n                        or use the Instant Messenger to communicate with another member. By reading about and sharing\r\n                        experiences, you’ll see how others are not only struggling with some of the exact same issues\r\n                        that you are, but they’re also succeeding - just like you!</p>\r\n                    <h4 class=\"eh_subtitle h4_subtitle\">Setbacks</h4>\r\n                    <p>Be prepared for setbacks and prepare your support squad for them. Help them to understand how\r\n                        you’ll handle <a data-toggle=\"modal\" href=\"#slip\">slips</a>.</p>\r\n                    <p>Setbacks do happen. There’ll be periods when you may feel compelled to go back to your past\r\n                        drinking patterns. When this happens, reach out to your Support Networks ASAP. Your Support\r\n                        Network is there to help you - so use them when you need them the most.</p>\r\n                    <p>\r\n                        When setbacks are about to occur, or when they do occur, these are the times when you should\r\n                        find your way to the Instant Messenger, Support Group or Health Educators so you can get some\r\n                        help. There’s bound to be someone going through the exact same thing you’re going through. After\r\n                        sharing, you’ll feel much better and you’ll be ready to start fresh with a new perspective.\r\n                    </p>\r\n                    <p>Or how about this: after you begin to succeed with this program, how about finding a new member\r\n                        that you can help out? New members will certainly be ready to learn from your experience,\r\n                        success and new-found wisdom. We bet that helping someone else out will make you feel good\r\n                        too.</p>\r\n\r\n\r\n                </div>\r\n                ', '\r\n                  <div class=\"quiz-content\">\r\n                    <p>Having a good support network can really help you stay on track to reaching your goals. Whether\r\n                        you are finding support within your family, friends or colleagues, it’s important to have people\r\n                        who will encourage you with your new lifestyle habits. If you’re finding that your family,\r\n                        friends and colleagues are not being particularly supportive, there are many other avenues you\r\n                        can try to gain support. Our community is an anonymous group of people just like yourself that\r\n                        will not judge you. </p>\r\n                    <p>Your Support Team can help in many, many ways. As you get used to cutting down or not drinking,\r\n                        they can serve non-alcoholic beverages during family and social gatherings. If you find yourself\r\n                        in a <a href=\"/problem-drinking/session?pageId=5&sessionId=38\" target=\"_blank\">trigger situation</a>, a good friend can quietly ask you if you’re OK or if\r\n                        you’d like to leave. </p>\r\n                    <p>Instead of heading to the bar or getting together for drinks, your Support Team can agree to get\r\n                        together in a different location; at least until you’re feeling confident and can be comfortable\r\n                        being