o\r\n                            provide alternatives alcoholic drinks - like pop, tonic water, fruit juice or tea. Practice\r\n                            saying <a href=\"/problem-drinking/session?pageId=11&sessionId=39\" target=\"_blank\">\"No thanks\"</a> in a polite way before you attend the\r\n                            function and remember: there’s absolutely nothing to be ashamed about when you tell people\r\n                            that you’re making smart lifestyle changes. You may even inspire some others to make the\r\n                            same smart choice.\r\n                        </li>\r\n                        <li>Involve your family when creating your <a href=\"/problem-drinking/session?pageId=15&sessionId=39\" target=\"_blank\">coping plan</a>. Share some of\r\n                            the\r\n                            exercises in this program and let them know how they can all help you in achieving your\r\n                            goals. Remember that it’s also important to address areas of concern. For example, make sure\r\n                            that everyone knows that you won’t be offended when they do not to ask you to go out to a\r\n                            bar after work on Friday.\r\n                        </li>\r\n                        <li>Explain to your partner, roommate or family that one of your early coping strategies calls\r\n                            for the need for you to clear out the cupboards and fridge. Make sure that everyone\r\n                            understands that, for the time being, it’s important to keep the house or apartment free of\r\n                            alcohol.\r\n                        </li>\r\n                    </ol>\r\n                    <p>The Health Educators in our anonymous community are also a great resource. Stop by our community\r\n                        or use the Instant Messenger to communicate with another member. By reading about and sharing\r\