(213, 494755, 10, 'Started at family dinner. Took drinking very lightly, not making conscious choices or thinking about consequences. Bad night. Black out. Minor Injury.', '2022-03-12'),
(214, 494755, 3, 'Usual wine', '2022-03-11'),
(215, 494755, 4, 'Dinner with a friend. had to drive. Had wine', '2022-03-10'),
(216, 494755, 1, 'French Beach', '2022-03-06'),
(217, 494755, 6, 'Out for dinner with Ryan in Langford', '2022-03-04'),
(218, 494755, 5, 'Some afternoon beers otherwise casual', '2022-03-05'),
(219, 494755, 4, 'Wine with Ryan', '2022-03-03'),
(220, 494755, 0, 'Nothing', '2022-03-02'),
(221, 494755, 0, 'Nothing', '2022-03-01'),
(222, 494755, 0, 'Nothing', '2022-02-28'),
(223, 494755, 0, 'Nothing', '2022-03-07'),
(224, 494755, 0, 'Nothing', '2022-03-08'),
(225, 494755, 0, 'Nothing', '2022-03-09'),
(226, 494755, 0, 'Tess and Jason came for dinner. Had a weed drink and some near beer.', '2022-03-20'),
(227, 494755, 0, 'Slight cravings but more for something sweet. had chocolate and tea.', '2022-03-21'),
(228, 494755, 0, 'Hard day with cravings started in mid-day. Challenging night with the kids and some chaos, but did not drink. Worked through the motions with the kids, Was a little grumpy/irritable. Ended up making popcorn and having a near beer. yay!', '2022-03-22'),
(229, 494755, 1, 'I had cravings throughout the afternoon. But for some reason my mind was running in general. The sun was shining and I was feeling deprived. But I had a call later that night that was important. I have a tiny bit of weed and a near beer and dinner with my parents. My mom even offered me wine and I declined. Later during my call in my own privacy I had a glass f wine, and I did not desire more; after it I had a tea and chocolate. ', '2022-03-23'),
(230, 494755, 1, 'Had a bit of light white wine with soda water while talking on the phone with Leslie and Hannah. They were both drinking red wine. I didn\'t feel tempted to drink more and I had a good sleep (lots of vivid dreams though). ', '2022-03-24'),
